(3, 1, 1, 'Regulamin', '', 'Regulamin', '18 Luty 2018', '<div class=\"row\">\n<div id=\"center_column\" class=\"center_column col-xs-12 col-sm-12\">\n<div class=\"rte\">\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 1 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Postanowienia wstępne<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span><span lang=\"pl\" xml:lang=\"pl\">Sklep internetowy fShop.pl, dostępny pod adresem internetowym www.fShop.pl , </span><span lang=\"pl\" xml:lang=\"pl\">prowadzony jest przez ....., wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej (CEIDG) prowadzonej przez ministra właściwego ds. gospodarki, NIP ......  REGON </span><span lang=\"pl\" xml:lang=\"pl\">......</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">2. Niniejszy Regulamin skierowany jest zarówno do Konsumentów, jak i do Przedsiębiorców korzystających ze Sklepu i określa zasady korzystania ze Sklepu internetowego oraz zasady i tryb zawierania Umów Sprzedaży z Klientem na odległość za pośrednictwem Sklepu.</span></p>\n<p><br /><br /></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 2 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Definicje<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1. </span><b><span lang=\"pl\" xml:lang=\"pl\">Konsument </span></b><span lang=\"pl\" xml:lang=\"pl\">- osoba fizyczna zawierająca ze Sprzedawcą umowę w ramach Sklepu, której przedmiot nie jest związany bezpośrednio z jej działalnością gospodarczą lub zawodową.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2. </span><b><span lang=\"pl\" xml:lang=\"pl\">Sprzedawca </span></b><span lang=\"pl\" xml:lang=\"pl\">- osoba fizyczna prowadząca działalność gospodarczą pod firmą ....... , wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej (CEIDG) prowadzonej przez ministra właściwego ds. gospodarki, NIP ........ , REGON  ............</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3. </span><b><span lang=\"pl\" xml:lang=\"pl\">Klient </span></b><span lang=\"pl\" xml:lang=\"pl\">- każdy podmiot dokonujący zakupów za pośrednictwem Sklepu.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4. </span><b><span lang=\"pl\" xml:lang=\"pl\">Przedsiębiorca </span></b><span lang=\"pl\" xml:lang=\"pl\">- osoba fizyczna, osoba prawna i jednostka organizacyjna niebędąca osobą prawną, której odrębna ustawa przyznaje zdolność prawną, wykonująca we własnym imieniu działalność gospodarczą, która korzysta ze Sklepu.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5. </span><b><span lang=\"pl\" xml:lang=\"pl\">Sklep </span></b><span lang=\"pl\" xml:lang=\"pl\">- sklep internetowy prowadzony przez Sprzedawcę pod adresem internetowym www.fShop.pl</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">6. </span><b><span lang=\"pl\" xml:lang=\"pl\">Umowa zawarta na odległość</span></b><span lang=\"pl\" xml:lang=\"pl\"> - umowa zawarta z Klientem w ramach zorganizowanego systemu zawierania umów na odległość (w ramach Sklepu), bez jednoczesnej fizycznej obecności stron, z wyłącznym wykorzystaniem jednego lub większej liczby środków porozumiewania się na odległość do chwili zawarcia umowy włącznie.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">7. </span><b><span lang=\"pl\" xml:lang=\"pl\">Regulamin </span></b><span lang=\"pl\" xml:lang=\"pl\">- niniejszy regulamin Sklepu.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">8. </span><b><span lang=\"pl\" xml:lang=\"pl\">Zamówienie </span></b><span lang=\"pl\" xml:lang=\"pl\">- oświadczenie woli Klienta składane za pomocą Formularza Zamówienia i zmierzające bezpośrednio do zawarcia Umowy Sprzedaży Produktu lub Produktów ze Sprzedawcą.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">9. </span><b><span lang=\"pl\" xml:lang=\"pl\">Konto</span></b><span lang=\"pl\" xml:lang=\"pl\"> - konto klienta w Sklepie, są w nim gromadzone są dane podane przez Klienta oraz informacje o złożonych przez niego Zamówieniach w Sklepie.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">10. </span><b><span lang=\"pl\" xml:lang=\"pl\">Formularz rejestracji </span></b><span lang=\"pl\" xml:lang=\"pl\">- formularz dostępny w Sklepie, umożliwiający utworzenie Konta.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">11. </span><b><span lang=\"pl\" xml:lang=\"pl\">Formularz zamówienia</span></b><span lang=\"pl\" xml:lang=\"pl\"> - interaktywny formularz dostępny w Sklepie umożliwiający złożenie Zamówienia, w szczególności poprzez dodanie Produktów do Koszyka oraz określenie warunków Umowy Sprzedaży, w tym sposobu dostawy i płatności.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">12. </span><b><span lang=\"pl\" xml:lang=\"pl\">Koszyk </span></b><span lang=\"pl\" xml:lang=\"pl\">– element oprogramowania Sklepu, w którym widoczne są wybrane przez Klienta Produkty do zakupu, a także istnieje możliwość ustalenia i modyfikacji danych Zamówienia, w szczególności ilości produktów.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">13. </span><b><span lang=\"pl\" xml:lang=\"pl\">Produkt </span></b><span lang=\"pl\" xml:lang=\"pl\">- dostępna w Sklepie rzecz ruchoma/usługa będąca przedmiotem Umowy Sprzedaży między Klientem a Sprzedawcą.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">14. </span><b><span lang=\"pl\" xml:lang=\"pl\">Umowa Sprzedaży</span></b><span lang=\"pl\" xml:lang=\"pl\"> - umowa sprzedaży Produktu zawierana albo zawarta między Klientem a Sprzedawcą za pośrednictwem Sklepu internetowego. Przez Umowę Sprzedaży rozumie się też - stosowanie do cech Produktu - umowę o świadczenie usług i umowę o dzieło.<br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 3 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Kontakt ze Sklepem<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span><span lang=\"pl\" xml:lang=\"pl\">Adres Sprzedawcy: ..........</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    </span><span lang=\"pl\" xml:lang=\"pl\">Adres e-mail Sprzedawcy: kontakt@fshop.pl</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.    </span><span lang=\"pl\" xml:lang=\"pl\">Numer telefonu Sprzedawcy: ...........</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.    </span><span lang=\"pl\" xml:lang=\"pl\">Numer rachunku bankowego Sprzedawcy : ................</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.    </span><span lang=\"pl\" xml:lang=\"pl\">Klient może porozumiewać się ze Sprzedawcą za pomocą adresów i numerów telefonów podanych w niniejszym paragrafie.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">6.    </span><span lang=\"pl\" xml:lang=\"pl\">Klient może porozumieć się telefonicznie ze Sprzedawcą w godzinach 10:00 - 18:00<br /><br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 4 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Wymagania techniczne<br /><br /></span></b></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">Do korzystania ze Sklepu, w tym przeglądania asortymentu Sklepu oraz składania zamówień na Produkty, niezbędne są:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.    </span><span lang=\"pl\" xml:lang=\"pl\">urządzenie końcowe z dostępem do sieci Internet z  przeglądarką internetową</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">b.    </span><span lang=\"pl\" xml:lang=\"pl\">aktywne konto poczty elektronicznej (e-mail),</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">c.    </span><span lang=\"pl\" xml:lang=\"pl\">włączona obsługa plików cookies,</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\"> </span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 5 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Informacje ogólne<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span><span lang=\"pl\" xml:lang=\"pl\">Sprzedawca w najszerszym dopuszczalnym przez prawo zakresie nie ponosi odpowiedzialności za zakłócenia w tym przerwy w funkcjonowaniu Sklepu spowodowane siłą wyższą, niedozwolonym działaniem osób trzecich lub niekompatybilnością Sklepu internetowego z infrastrukturą techniczną Klienta.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    </span><span lang=\"pl\" xml:lang=\"pl\">Przeglądanie asortymentu Sklepu nie wymaga zakładania Konta. Składanie zamówień przez Klienta na Produkty znajdujące się w asortymencie Sklepu możliwe jest albo po założeniu Konta zgodnie z postanowieniami § 6 Regulaminu albo przez podanie niezbędnych danych osobowych i adresowych umożliwiających realizację Zamówienia bez zakładania Konta.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.    </span><span lang=\"pl\" xml:lang=\"pl\"> Ceny podane w Sklepie są podane w polskich złotych.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.    </span><span lang=\"pl\" xml:lang=\"pl\">Na końcową (ostateczną) kwotę do zapłaty przez Klienta składa się cena netto za Produkt oraz podatek VAT 23%, o której Klient jest informowany na stronach Sklepu w trakcie składania Zamówienia, w tym także w chwili wyrażenia woli związania się Umową Sprzedaży.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.    </span><span lang=\"pl\" xml:lang=\"pl\">W przypadku Umowy obejmującej prenumeratę lub świadczenie usług na czas nieoznaczony końcową (ostateczną) ceną jest łączna cena obejmująca wszystkie płatności za okres rozliczeniowy.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">6.    </span><span lang=\"pl\" xml:lang=\"pl\">Gdy charakter przedmiotu Umowy nie pozwala, rozsądnie oceniając, na wcześniejsze obliczenie wysokości końcowej (ostatecznej) ceny, informacja o sposobie, w jaki cena będzie obliczana, a także o opłatach za transport, dostarczenie, usługi pocztowe oraz o innych kosztach, będzie podana w Sklepie w opisie Produktu.</span></p>\n<p></p>\n<p class=\"Normalny1\" align=\"center\"><span lang=\"pl\" xml:lang=\"pl\"> </span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 6 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Zakładanie Konta w Sklepie<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span><span lang=\"pl\" xml:lang=\"pl\">Aby założyć Konto w Sklepie, należy wypełnić Formularz rejestracji. Niezbędne jest podanie następujących danych: Imię i Nazwisko lub nazwa frmy , Adres zamieszkania lub adres siedziby firmy , adres e-mail, aktualny numer telefonu</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    </span><span lang=\"pl\" xml:lang=\"pl\">Założenie Konta w Sklepie jest darmowe.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.    </span><span lang=\"pl\" xml:lang=\"pl\">Logowanie się na Konto odbywa się poprzez podanie loginu i hasła ustanowionych w Formularzu rejestracji.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.    </span><span lang=\"pl\" xml:lang=\"pl\">Klient ma możliwość w każdej chwili, bez podania przyczyny i bez ponoszenia z tego tytułu jakichkolwiek opłat usunąć Konto poprzez wysłanie stosownego żądania do Sprzedawcy, w szczególności za pośrednictwem poczty elektronicznej lub pisemnie na adresy podane w § 3.<br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><span lang=\"pl\" xml:lang=\"pl\"> </span><b><span lang=\"pl\" xml:lang=\"pl\">§ 7 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Zasady składania Zamówienia<br /><br /></span></b></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">W celu złożenia Zamówienia należy:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.   W</span><span lang=\"pl\" xml:lang=\"pl\">ybrać Produkt będący przedmiotem Zamówienia, a następnie kliknąć przycisk „Do koszyka” </span><span lang=\"pl\" xml:lang=\"pl\">(lub równoznaczny)</span><span lang=\"pl\" xml:lang=\"pl\">;</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    Z</span><span lang=\"pl\" xml:lang=\"pl\">alogować się lub skorzystać z możliwości złożenia Zamówienia bez rejestracji;</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.   J</span><span lang=\"pl\" xml:lang=\"pl\">eżeli wybrano możliwość złożenia Zamówienia bez rejestracji - wypełnić Formularz zamówienia poprzez wpisanie danych odbiorcy Zamówienia oraz adresu, na który ma nastąpić dostawa Produktu, wybrać rodzaj przesyłki (sposób dostarczenia Produktu), wpisać dane do faktury, jeśli są inne niż dane odbiorcy Zamówienia,</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.    K</span><span lang=\"pl\" xml:lang=\"pl\">liknąć przycisk “Zamawiam i płacę”</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.    W</span><span lang=\"pl\" xml:lang=\"pl\">ybrać  sposób płatności i opłacić zamówienie.<br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 8 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Oferowane metody dostawy oraz płatności<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span><span lang=\"pl\" xml:lang=\"pl\">Klient może skorzystać z następujących metod dostawy lub odbioru zamówionego Produktu:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.    </span><span lang=\"pl\" xml:lang=\"pl\">Przesyłka wirutalna na adres e-mailowy Klienta<br /><br /></span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    </span><span lang=\"pl\" xml:lang=\"pl\">Klient może skorzystać z następujących metod płatności:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.    </span><span lang=\"pl\" xml:lang=\"pl\">Płatność przelewem na konto Sprzedawcy</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">b.    </span><span lang=\"pl\" xml:lang=\"pl\">Płatności elektroniczne</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">c.    </span><span lang=\"pl\" xml:lang=\"pl\">Płatność kartą płatniczą.<br /><br /></span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">3. Szczegółowe informacje na temat metod dostawy oraz akceptowalnych metod płatności znajdują się za stronach Sklepu.<br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 9 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Wykonanie umowy sprzedaży<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span><span lang=\"pl\" xml:lang=\"pl\">Zawarcie Umowy Sprzedaży między Klientem a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia za pomocą Formularza zamówienia w Sklepie internetowym zgodnie z § 7 Regulaminu.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    </span><span lang=\"pl\" xml:lang=\"pl\">Po złożeniu Zamówienia Sprzedawca niezwłocznie potwierdza jego otrzymanie oraz jednocześnie przyjmuje Zamówienie do realizacji. Potwierdzenie otrzymania Zamówienia i jego przyjęcie do realizacji następuje poprzez przesłanie przez Sprzedawcę Klientowi stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta, która zawiera co najmniej oświadczenia Sprzedawcy o otrzymaniu Zamówienia i o jego przyjęciu do realizacji oraz potwierdzenie zawarcia Umowy Sprzedaży. Z chwilą otrzymania przez Klienta powyższej wiadomości e-mail zostaje zawarta Umowa Sprzedaży między Klientem a Sprzedawcą.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3. </span><span lang=\"pl\" xml:lang=\"pl\"> W przypadku zamówienia Produktów o różnych terminach dostawy, terminem dostawy jest najdłuższy podany termin.</span></p>\n<p> W przypadku zamówienia Produktów o różnych terminach dostawy, Klient ma możliwość żądania dostarczenia Produktów częściami lub też dostarczenia wszystkich Produktów po skompletowaniu całego zamówienia.</p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.    </span><span lang=\"pl\" xml:lang=\"pl\">Początek biegu terminu dostawy Produktu do Klienta liczy się od dnia zaksięgowania płatności za zakup na rachunku bankowym Sprzedawcy.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">5. W przypadku wyboru przez Klienta odbioru osobistego Produktu, Produkt będzie gotowy do odbioru przez Klienta w dniu następnym roboczym po otrzymaniu płatności przez Sprzedawcę. O gotowości Produktu do odbioru Klient zostanie dodatkowo poinformowany przez Sprzedawcę poprzez przesłanie stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta.</span> </p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">6. W przypadku zamówienia Produktów o różnych terminach gotowości do odbioru, Klient ma możliwość odbierania Produktów częściami (stosownie do ich gotowości do odbioru) lub też odbioru wszystkich Produktów po skompletowaniu całego zamówienia.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">7. Dostawa Produktu odbywa się wyłącznie na terenie Polski.<br /><br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 10 Rozwiązanie umowy</span></b><b><span lang=\"pl\" xml:lang=\"pl\"><br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span>Zamówienie usług internetowych (elektronicznych) przez Konsumenta lub Przedsiębiorcę wiąże się z utratą prawa do odstąpienia od niniejszej umowy i braku zwrotu wpłaconych opłat za usługi.<br /><br />2. Usługodawcy przysługuje prawo rozwiązania Umowy ze skutkiem natychmiastowym w następujących przypadkach:</p>\n<p class=\"Normalny1CxSpMiddle\">a. podanie przez Klienta fałszywych danych w trakcie rejestracji,</p>\n<p class=\"Normalny1CxSpMiddle\">b. niepowiadomienie Usługodawcy o zmianie danych rejestrowych Klienta w terminie 30 dni od dokonania zmiany,</p>\n<p class=\"Normalny1CxSpMiddle\">c. nieuiszczenie przez Klienta opłat za Usługę,</p>\n<p class=\"Normalny1CxSpMiddle\">d. prowadzenie za pośrednictwem Sklepu internetowego sprzedaży towarów lub usług zabronionych przez prawo lub pochodzących z przestępstw.</p>\n<p class=\"Normalny1CxSpMiddle\">e. rażącego naruszenia innych postanowień niniejszego Regulaminu.</p>\n<p class=\"Normalny1CxSpMiddle\">f. działanie na szkodę Usługodawcy oraz werbalne lub pisemne nadużycie w stosunku do Usługodawcy może skutkować wypowiedzeniem umowy w trybie natychmiastowym. W powyższych przypadkach Klientowi nie przysługuje zwrot wpłaconej należności za już wykorzystany okres abonamentowy</p>\n<p class=\"Normalny1CxSpMiddle\"></p>\n<!-- \n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    </span><span lang=\"pl\" xml:lang=\"pl\">Bieg terminu określonego w ust. 1 rozpoczyna się od dostarczenia Produktu Konsumentowi lub wskazanej przez niego osobie innej niż przewoźnik.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">3.    </span><span lang=\"pl\" xml:lang=\"pl\">W przypadku Umowy, która obejmuje wiele Produktów, które są dostarczane osobno, partiami lub w częściach, termin wskazany w ust. 1 biegnie od dostawy ostatniej rzeczy, partii lub części.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.    </span><span lang=\"pl\" xml:lang=\"pl\">W przypadku Umowy, która polega na regularnym dostarczaniu Produktów przez czas oznaczony (prenumerata), termin wskazany w ust. 1 biegnie od objęcia w posiadanie pierwszej z rzeczy.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.    </span><span lang=\"pl\" xml:lang=\"pl\">Konsument może odstąpić od Umowy, składając Sprzedawcy oświadczenie o odstąpieniu od Umowy. Do zachowania terminu odstąpienia od Umowy wystarczy wysłanie przez Konsumenta oświadczenia przed upływem tego terminu.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">6.    </span><span lang=\"pl\" xml:lang=\"pl\">Oświadczenie może być wysłane za pomocą tradycyjnej poczty poprzez przesłanie oświadczenia na adres Sprzedawcy - dane kontaktowe Sprzedawcy zostały określone w § 3.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">7.    </span><span lang=\"pl\" xml:lang=\"pl\">W przypadku przesłania oświadczenia przez Konsumenta drogą elektroniczną, Sprzedawca niezwłocznie prześle Konsumentowi na podany przez Konsumenta adres e-mail potwierdzenie otrzymania oświadczenia o odstąpieniu od Umowy.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">8.    </span><span lang=\"pl\" xml:lang=\"pl\">Skutki odstąpienia od Umowy:</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.    </span><span lang=\"pl\" xml:lang=\"pl\">W przypadku odstąpienia od Umowy zawartej na odległość Umowę uważa się za niezawartą.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">b.    </span><span lang=\"pl\" xml:lang=\"pl\">W przypadku odstąpienia od Umowy Sprzedawca zwraca Konsumentowi niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Konsumenta o odstąpieniu od Umowy, wszystkie dokonane przez niego płatności, w tym koszty dostarczenia rzeczy, z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Konsumenta sposobu dostarczenia innego niż najtańszy zwykły sposób dostarczenia oferowany przez Sprzedawcę.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">c.    </span><span lang=\"pl\" xml:lang=\"pl\">Zwrotu płatności Sprzedawca dokona przy użyciu takich samych metod płatności, jakie zostały przez Konsumenta użyte w pierwotnej transakcji, chyba że Konsument wyraźnie zgodził się na inne rozwiązanie, które nie będzie się wiązało dla niego z żadnymi kosztami.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">d.    </span><span lang=\"pl\" xml:lang=\"pl\">Sprzedawca może wstrzymać się ze zwrotem płatności do czasu otrzymania Produktu z powrotem </span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">e.    </span><span lang=\"pl\" xml:lang=\"pl\">Konsument powinien odesłać Produkt na adres Sprzedawcy podany w niniejszym Regulaminie niezwłocznie, nie później niż 14 dni od dnia, w którym poinformował Sprzedawcę o odstąpieniu od Umowy. Termin zostanie zachowany, jeśli Konsument odeśle Produkt przed upływem terminu 14 dni.</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">f.     </span><span lang=\"pl\" xml:lang=\"pl\">Konsument ponosi bezpośrednie koszty zwrotu Produktu</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">g.    </span><span lang=\"pl\" xml:lang=\"pl\">Konsument odpowiada tylko za zmniejszenie wartości Produktu wynikające z korzystania z niego w sposób inny niż było to konieczne do stwierdzenia charakteru, cech i funkcjonowania Produktu.</span></p>\n    <p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">9. W przypadku gdy ze względu na charakter Produktu nie może on zostać odesłany w zwykłym trybie pocztą, informacja o tym, a także o kosztach zwrotu Produktu, będzie się znajdować w opisie Produktu w Sklepie.</span></p>\n    <p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">10. Prawo do odstąpienia od umowy zawartej na odległość nie przysługuje Konsumentowi w odniesieniu do Umowy:</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.    </span><span lang=\"pl\" xml:lang=\"pl\">w której przedmiotem świadczenia jest rzecz nieprefabrykowana, wyprodukowana według specyfikacji Konsumenta lub służąca zaspokojeniu jego zindywidualizowanych potrzeb,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">b.    </span><span lang=\"pl\" xml:lang=\"pl\">w której przedmiotem świadczenia jest rzecz dostarczana w zapieczętowanym opakowaniu, której po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">c.    </span><span lang=\"pl\" xml:lang=\"pl\">w które przedmiotem świadczenia jest rzecz ulegająca szybkiemu zepsuciu lub mająca krótki termin przydatności do użycia,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">d.    </span><span lang=\"pl\" xml:lang=\"pl\">o świadczenie usług, jeżeli Sprzedawca wykonał w pełni usługę za wyraźną zgodą Konsumenta, który został poinformowany przez rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedawcę utraci prawo odstąpienia od Umowy,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">e.    </span><span lang=\"pl\" xml:lang=\"pl\">w którym cena lub wynagrodzenie zależy od wahań na rynku finansowym, nad którym Sprzedawca nie sprawuje kontroli, i które mogą wystąpić przed upływem terminu do odstąpienia od Umowy,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">f.     </span><span lang=\"pl\" xml:lang=\"pl\">w której przedmiotem świadczenia są rzeczy, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">g.    </span><span lang=\"pl\" xml:lang=\"pl\">w której przedmiotem świadczenia są napoje alkoholowe, których cena została uzgodniona przy zawarciu umowy sprzedaży, a których dostarczenie może nastąpić dopiero po upływie 30 dni i których wartość zależy od wahań na rynku, nad którymi Sprzedawca nie ma kontroli,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">h.    </span><span lang=\"pl\" xml:lang=\"pl\">w której przedmiotem świadczenia są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">i.      </span><span lang=\"pl\" xml:lang=\"pl\">o dostarczanie dzienników, periodyków lub czasopism, z wyjątkiem umowy o prenumeratę,</span></p>\n    <p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">j.      </span><span lang=\"pl\" xml:lang=\"pl\">o dostarczenie treści cyfrowych, które nie są zapisane na nośniku materialnym, jeżeli spełnianie świadczenia rozpoczęło się za wyraźną zgodą Konsumenta przed upływem terminu do odstąpienia od umowy i po poinformowaniu go przez Sprzedawcę o utracie prawa odstąpienia od Umowy,</span></p>\n    <p></p>\n    <p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\"> </span></p> -->\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 11 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Reklamacja i gwarancja</span></b></p>\n<p class=\"Normalny1\" align=\"center\"></p>\n<p></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span><span lang=\"pl\" xml:lang=\"pl\">Umową Sprzedaży objęte usługi elektroniczne.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    </span><span lang=\"pl\" xml:lang=\"pl\">W przypadku wystąpienia wady zakupionej u Sprzedawcy usługi Klient ma prawo do reklamacji w oparciu o przepisy dotyczące rękojmi w kodeksie cywilnym.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">3. W przypadku wystąpienia wady zakupionej u Sprzedawcy usługi Klient ma prawo do reklamacji w oparciu o przepisy dotyczące rękojmi w kodeksie cywilnym. Jeżeli Klientem jest Przedsiębiorca, strony wyłączają odpowiedzialność z tytułu rękojmi.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">4.    </span><span lang=\"pl\" xml:lang=\"pl\">Reklamację należy zgłosić pisemnie lub drogą elektroniczną na podane w niniejszym Regulaminie adresy Sprzedawcy.</span> </p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">5.    </span><span lang=\"pl\" xml:lang=\"pl\">Zaleca się, aby w reklamacji zawrzeć m.in. zwięzły opis wady, okoliczności (w tym datę) jej wystąpienia, dane Klienta składającego reklamację, oraz żądanie Klienta w związku z wadą towaru.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">6. Sprzedawca ustosunkuje się do żądania reklamacyjnego niezwłocznie i wyznaczy termin naprawy usługi nie później niż 30 dni od zgłoszenia<br /><br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 12 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Pozasądowe sposoby rozpatrywania reklamacji i dochodzenia roszczeń<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.    </span><span lang=\"pl\" xml:lang=\"pl\">Szczegółowe informacje dotyczące możliwości skorzystania przez Konsumenta z  pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń oraz zasady dostępu do tych procedur dostępne są w siedzibach oraz na stronach internetowych powiatowych (miejskich) rzeczników konsumentów, organizacji społecznych, do których zadań statutowych należy ochrona konsumentów, Wojewódzkich Inspektoratów Inspekcji Handlowej oraz pod następującymi adresami internetowymi Urzędu Ochrony Konkurencji i Konsumentów: http://www.uokik.gov.pl/spory_konsumenckie.php; http://www.uokik.gov.pl/sprawy_indywidualne.php oraz http://www.uokik.gov.pl/wazne_adresy.php.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.    </span><span lang=\"pl\" xml:lang=\"pl\">Konsument posiada następujące przykładowe możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń:</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">a.    </span><span lang=\"pl\" xml:lang=\"pl\">Konsument uprawniony jest do zwrócenia się do stałego polubownego sądu konsumenckiego, o którym mowa w art. 37 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej (Dz.U. z 2014 r. poz. 148 z późn. zm.), z wnioskiem o rozstrzygnięcie sporu wynikłego z Umowy zawartej ze Sprzedawcą.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">b.    </span><span lang=\"pl\" xml:lang=\"pl\">Konsument uprawniony jest do zwrócenia się do wojewódzkiego inspektora Inspekcji Handlowej, zgodnie z art. 36 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej (Dz.U. z 2014 r. poz. 148 z późn. zm.), z wnioskiem o wszczęcie postępowania mediacyjnego w sprawie polubownego zakończenia sporu między Konsumentem a Sprzedawcą.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">c.    </span><span lang=\"pl\" xml:lang=\"pl\">Konsument może uzyskać bezpłatną pomoc w sprawie rozstrzygnięcia sporu między nim a Sprzedawcą, korzystając także z bezpłatnej pomocy powiatowego (miejskiego) rzecznika konsumentów lub organizacji społecznej, do której zadań statutowych należy ochrona konsumentów (m.in. Federacja Konsumentów, Stowarzyszenie Konsumentów Polskich).<br /><br /><br /><br /></span></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 13 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Dane osobowe w Sklepie internetowym<br /><br /></span></b></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">1.   </span><span lang=\"pl\" xml:lang=\"pl\">Administratorem danych osobowych Klientów zbieranych i przetwarzanych za pośrednictwem Sklepu internetowego jest Sprzedawca.</span></p>\n<p class=\"Normalny1CxSpMiddle\"><span lang=\"pl\" xml:lang=\"pl\">2.   </span><span lang=\"pl\" xml:lang=\"pl\">Dane osobowe Klientów zbierane i przetwarzane przez administratora za pośrednictwem Sklepu internetowego zbierane są w celu realizacji Umowy Sprzedaży.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">3. Podanie danych osobowych jest dobrowolne, aczkolwiek niepodanie wskazanych w Regulaminie danych osobowych niezbędnych do zawarcia Umowy Sprzedaży skutkuje brakiem możliwości zawarcia tejże umowy.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">4. Pełna informacja nt celów przetwarzania oraz praw Klienta dostępna jest w zakładce \"RODO\" -  <a href=\"/info/12-rodo\" target=\"_blank\" rel=\"noreferrer noopener\">Informacja nt przetwarzania danych osobowych</a></span></p>\n<p class=\"Normalny1\"><br /><br /><br /></p>\n<p class=\"Normalny1\" align=\"center\"><b><span lang=\"pl\" xml:lang=\"pl\">§ 14 </span></b><b><span lang=\"pl\" xml:lang=\"pl\">Postanowienia końcowe<br /><br /></span></b></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">1. Umowy zawierane poprzez Sklep internetowy zawierane są w języku polskim.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">2. Sprzedawca zastrzega sobie prawo do dokonywania zmian Regulaminu z ważnych przyczyn to jest: zmiany przepisów prawa, zmiany sposobów płatności i dostaw - w zakresie, w jakim te zmiany wpływają na realizację postanowień niniejszego Regulaminu. O każdej zmianie Sprzedawca poinformuje Klienta z co najmniej 7 dniowym wyprzedzeniem.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">3. W sprawach nieuregulowanych w niniejszym Regulaminie mają zastosowanie powszechnie obowiązujące przepisy prawa polskiego, w szczególności: Kodeksu cywilnego; ustawy o świadczeniu usług drogą elektroniczną; ustawy o prawach konsumenta, ustawy o ochronie danych osobowych.</span></p>\n<p class=\"Normalny1\"><span lang=\"pl\" xml:lang=\"pl\">4. Klient ma prawo skorzystać z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń. W tym celu może złożyć skargę za pośrednictwem unijnej platformy internetowej ODR dostępnej pod adresem: <a href=\"http://ec.europa.eu/consumers/odr/\">http://ec.europa.eu/consumers/odr/</a>.</span></p>\n<p align=\"center\"></p>\n<p align=\"center\"></p>\n</div>\n</div>\n<!-- #center_column --></div>', 'regulamin'),
(12, 1, 1, 'Politka prywatności', '', '', '18 Luty 2018', '<p align=\"center\"><span style=\"font-size:medium;\"><b>Informacja dotycząca przetwarzania danych osobowych<br /></b></span><span style=\"font-size:medium;\">(zgodnie z Rozporządzeniem Parlamentu Europejskiego i Rady (UE) 2016_679 z dnia 27 kwietnia)</span></p>\n<p><br /><br /></p>\n<p><span style=\"font-size:medium;\">Poniższa „</span><span style=\"font-size:medium;\"><b>Informacja</b></span><span style=\"font-size:medium;\">” ma na celu przedstawienie Ci Twoich praw dotyczących przetwarzania przez nas Twoich danych osobowych, dostarczenia Ci informacji nt przetwarzania przez nas Twoich danych osobowych, wyjaśnienia w jakim celu je przetwarzamy, kiedy może być konieczne ich przekazanie innym podmiotom, oraz jak długo będziemy je przetwarzać i przechowywać.</span></p>\n<ol>\n<li>\n<p><span style=\"font-size:medium;\">Administratorem Twoich danych osobowych jest .........., z siedzibą w ............... (dalej „my”), tel: +48 .............</span></p>\n</li>\n</ol><ol start=\"2\">\n<li>\n<p><span style=\"font-size:medium;\">Adres e-mail do kontaktu w sprawie przetwarzania danych osobowych: <a href=\"mailto:kontakt@fshop.pl\">kontakt@fshop.pl</a></span></p>\n</li>\n</ol><ol start=\"3\">\n<li>\n<p><span style=\"font-size:medium;\">Podanie nam danych jest dobrowolne, ale niezbędne do realizacji umowy sprzedaży, umowy na wykonanie usługi, czy przedstawienia Ci oferty handlowej na nasze towary i usługi (przedstawimy Ci ofertę tylko na Twoje wyraźne życzenie i tylko w zakresie o jaki zapytasz).</span></p>\n</li>\n</ol><ol start=\"4\">\n<li>\n<p><span style=\"font-size:medium;\">W każdej chwili masz prawo dostępu do swoich danych, ich sprostowania poprzez kontakt e-mail wskazany w punkcie 2, lub jeśli korzystasz z naszego sklepu internetowego, po zalogowaniu się, w zakładce „moje konto”.</span></p>\n</li>\n</ol><ol start=\"5\">\n<li>\n<p><span style=\"font-size:medium;\">Masz prawo do usunięcia Twoich danych osobowych przez wysłanie do nas, na adres e-mail podany w punkcie 2, takiego żądanie. Zrobimy to, chyba że będzie istniała inna podstawa prawna, </span><span style=\"color:#222222;\"><span style=\"font-size:medium;\"><span>wynikająca z prawa finansowego lub kodeksu cywilnego, która będzie nakładała na nas obowiązek dalszego przetwarzania Twoich danych.</span></span></span><span style=\"font-size:medium;\"> </span></p>\n</li>\n</ol>\n<p></p>\n<p></p>\n<p><span style=\"font-size:medium;\">- Jeśli robiłeś zakupy przez nasz sklep internetowy, lub za pomocą platformy sprzedaży internetowej jesteśmy zobowiązani przetwarzać Twoje dane przez okres 3 lat, od końca roku kalendarzowego w którym zrobiłeś u nas ostatnie zakupy (podstawa prawna: art. 118 KC)</span></p>\n<p><span style=\"font-size:medium;\">- Jeśli robiłeś zakupy towaru w naszym stacjonarnym punkcie handlowym i na Twoje życzenie wystawiliśmy Ci imienny paragon lub fakturę sprzedaży jesteśmy zobowiązani przetwarzać Twoje dane przez okres 2 lat, od końca roku kalendarzowego w którym zrobiłeś ostatnie zakupy (podstawa prawna: art. 554 KC)</span></p>\n<p><span style=\"font-size:medium;\">- Jeśli wykonywaliśmy dla Ciebie usługę (na podstawie umowy o wykonanie usługi), jesteśmy zobowiązani do przetwarzania Twoich danych przez 10 lat, od końca roku kalendarzowego, w którym usługa została wykonana (podstawa prawna: art. 118 KC)</span></p>\n<p><span style=\"font-size:medium;\">- Po tym jak zażądasz od nas usunięcia Twoich danych, możemy nadal je przetwarzać, tylko w podanych poniżej celach, na podstawie prawnie uzasadnionych interesów  ...............</span></p>\n<ol>\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">windykacja należności</span></span></p>\n</li>\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">prowadzenie postępowań sądowych, arbitrażowych i mediacyjnych</span></span></p>\n</li>\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">przechowywanie danych dla celów archiwizacyjnych oraz zapewnienie rozliczalności (wykazania spełnienia przez nas obowiązków wynikających z przepisów prawa)</span></span></p>\n</li>\n</ol>\n<p><span style=\"color:#222222;\"> <br /><span style=\"font-size:medium;\">Po wygaśnięciu tych celów, Twoje dane zostaną automatycznie usunięte.</span></span></p>\n<ol start=\"6\">\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">Masz także prawo do ograniczenia przetwarzania danych do ich przechowywania, przesyłając nam takie żądanie na adres e-mail podany w punkcie 2</span></span><span style=\"font-size:medium;\">. Po otrzymaniu takiego żądania, ograniczymy przetwarzanie Twoich danych tylko do ich przechowywania, przestaniemy wtedy wykonywać inne czynności składające się na przetwarzanie.</span></p>\n</li>\n</ol>\n<p></p>\n<ol start=\"7\">\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">Masz także prawo do odwołania wyrażonej wcześniej zgody na przetwarzanie danych osobowych (poinformuj nas o swojej decyzji wiadomością na adres e-mail wskazany w punkcie 2). Skorzystanie z  prawa cofnięcia zgody nie ma wpływu na przetwarzanie, które miało miejsce do momentu wycofania zgody.</span></span></p>\n</li>\n</ol><ol start=\"8\">\n<li>\n<p><span style=\"color:#222222;\"><span style=\"font-size:medium;\">Masz także prawo do przenoszenia danych. Na Twoje żądanie (</span></span><span style=\"font-size:medium;\">przesłane na adres e-mail w punkcie 2</span><span style=\"color:#222222;\"><span style=\"font-size:medium;\">), w ciągu miesiąca przygotujemy i wyślemy Ci plik w formacie</span></span><span style=\"color:#ff0000;\"><span style=\"font-size:medium;\"> </span></span><span style=\"font-size:medium;\">.csv.</span></p>\n</li>\n</ol>\n<p></p>\n<p><span style=\"font-size:medium;\">- W ramach prawa do przenoszenia danych, możesz wskazać nam podmiot do którego mamy dane przesłać. Ponieważ mamy obowiązek dbania o bezpieczeństwo Twoich danych, zanim zażądasz przeniesienia swoich danych, upewnij się do kogo trafią</span></p>\n<p></p>\n<p><span style=\"font-size:medium;\">- Kiedy przyślesz do nas żądanie przekazania danych, ze względów bezpieczeństwa, zostaniesz poddany weryfikacji. Gdy przejdziesz ją pozytywnie, prześlemy Ci kopię Twoich danych zachowując adekwatne środki bezpieczeństwa.</span></p>\n<p></p>\n<ol start=\"9\">\n<li>\n<p><span style=\"font-size:medium;\">Twoje dane osobowe które przetwarzamy to:</span></p>\n</li>\n</ol>\n<ul>\n<li><span style=\"font-size:medium;\">Twoje imię i nazwiska</span></li>\n<li><span style=\"font-size:medium;\">opcjonalnie nazwę firmy w której pracujesz </span></li>\n<li><span style=\"font-size:medium;\">Twój adres (lub adres Twojego miejsca pracy, lub każdy inny adres który wskażesz jako adres dostawy zamówionych przez Ciebie towarów lub wykonania usługi)</span></li>\n<li><span style=\"font-size:medium;\">Twój adres e-mail</span></li>\n<li><span style=\"font-size:medium;\">opcjonalnie Twój nr telefonu</span></li>\n</ul>\n<ol start=\"10\">\n<li>\n<p><span style=\"font-size:medium;\">Jeżeli dane które nam podasz należą do innej osoby (Ty zamawiasz i płacisz, lub tylko zamawiasz wskazując jako odbiorcę inna osobę) pamiętaj, że mamy obowiązek poinformować tę osobę o przekazaniu nam przez Ciebie jej danych, oraz wszystkich informacji, które przekazujemy teraz Tobie, i że możemy zrealizować umowę sprzedaży towaru lub usługi dopiero gdy uzyskamy zgodę tej osoby na przetwarzanie przez nas jej danych.</span></p>\n</li>\n</ol>\n<p></p>\n<ol start=\"11\">\n<li>\n<p><span style=\"font-size:medium;\">Przetwarzanie Twoich danych osobowych ma różne cele. Poniżej ich lista:</span></p>\n</li>\n</ol>\n<ul style=\"list-style-type:disc;\">\n<li><span style=\"font-size:medium;\">Twoje imię, nazwisko, adres, adres e-mail (i opcjonalnie nazwę firmy w której pracujesz) przetwarzamy aby zrealizować umowę sprzedaży lub umowę na wykonanie usługi</span></li>\n<li><span style=\"font-size:medium;\">Twoje imię, nazwisko i adres e-mail (i opcjonalnie nr telefonu) przetwarzamy aby przedstawić Ci ofertę handlową na nasze usługi i towary – ofertę przedstawimy Ci tylko na Twoje wyraźne życzenie, określające których towarów i usług oferta ma dotyczyć.</span></li>\n<li><span style=\"font-size:medium;\">Twój adres e-mail (i opcjonalnie nr telefonu) przetwarzamy dodatkowo aby poinformować Cię o stanie realizacji Twojego zamówienia, przekazania Ci informacji o sposobie dostawy czy innych informacji dotyczących sposobu realizacji zamówienia towarów lub usług.</span></li>\n</ul>\n<ol start=\"12\">\n<li>\n<p><span style=\"font-size:medium;\">Konieczne może być przekazanie Twoich danych (na podstawie umowy o powierzeniu danych osobowych do przetwarzania) firmom wspierającym naszą firmę w celu realizacji Twojego zamówienia – firmie kurierskiej, firmie pośredniczącej w płatnościach internetowych, platformie sprzedaży internetowej.</span></p>\n</li>\n</ol>\n<p><span style=\"font-size:medium;\">Twoje dane powierzamy do przetwarzania tylko firmom, które zapewniają wystarczające gwarancje ich bezpieczeństwa.</span></p>\n<ol start=\"13\">\n<li>\n<p><span style=\"font-size:medium;\">W naszej firmie do Twoich danych mają dostęp jedynie pracownicy odpowiedzialni za realizację Twojego zamówienia. Każdy z nich jest zobowiązany do zachowania w tajemnicy Twoich danych i przetwarzania tylko tych danych, które są mu niezbędne dla realizacji Twojego zamówienia.</span></p>\n</li>\n</ol>\n<p></p>\n<ol start=\"14\">\n<li>\n<p><span style=\"font-size:medium;\">Informujemy, że nie przetwarzamy Twoich danych w celu profilowania czy celach marketingowych (np. przesyłanie Ci newslettera, niechcianych ofert, reklam).</span></p>\n</li>\n</ol>\n<h2>Cookies</h2>\n<p>Pliki cookies (tzw. ciasteczka) to niewielkie pliki tekstowe wysyłane przez odwiedzany serwis internetowy do urządzenia internauty (komputer, smartfon itp.). Nie zawierają one żadnych danych osobowych.</p>\n<p>Nasz Serwis stosuje następujące cookies:</p>\n<p>1. wydajnościowe (zbierające informacje na temat sposobu używania witryny przez odwiedzających, np. najczęściej odwiedzanych stron lub komunikatów o błędach itp.),<br /> 2. funkcjonalne (zapisujące ustawienia użytkownika, np. język, wyrażone zgody itp.)</p>\n<ul>\n<li>cookies google-analytics.com – służą do prowadzenia statystyk dla witryny gov.pl; dokładny sposób działania i politykę prywatności Google Analytics można znaleźć pod adresem: https://marketingplatform.google.com/about/analytics/terms/pl/, https://policies.google.com/privacy</li>\n<li>cookies .facebook.com – służą do obsługi skryptów z serwisu facebook.com takich jak polubienia, udostępnianie postów czy logowania</li>\n<li>cookies .google.com – obsługa np. logowania poprzez Google+/Gmail, reklam Google Ads czy funkcji analitycznych ruchu na stronie</li>\n<li>cookies sesyjne – są to tymczasowe informacje przechowywane w pamięci przeglądarki do momentu zakończenia sesji, czyli jej zamknięcia.</li>\n</ul>\n<p><br /><strong style=\"margin:0px;padding:0px;font-size:16px;line-height:inherit;font-family:\'Open Sans\', sans-serif;vertical-align:baseline;color:#1b1b1b;background-color:#ffffff;\">W większości przeglądarek internetowych można: kasować pliki typu cookies z twardego dysku komputera (z poziomu ustawień przeglądarki), zablokować wszystkie przysyłane pliki typu cookies lub ustawić ostrzeżenie przed zapisaniem ich na dysku. </strong><br /><br />Należy mieć na uwadze, że zmiany ustawień tych plików polegające na ograniczeniu ich stosowania mogą wpłynąć na niektóre funkcjonalności dostępne na stronach internetowych je stosujących np. uniemożliwiając zalogowanie się na konto pocztowe. Brak zmiany tych ustawień oznacza akceptację dla stosowania plików typu cookies.</p>\n<h2>Jak wyłączyć ciasteczka?</h2>\n<ul>\n<li><a target=\"_blank\" href=\"http://support.google.com/chrome/bin/answer.py?hl=pl&amp;answer=95647\" rel=\"noreferrer noopener\">Instrukcja dot. zablokowania plików cookie w Chrome</a></li>\n<li><a target=\"_blank\" href=\"http://support.mozilla.org/pl/kb/W%C5%82%C4%85czanie%20i%20wy%C5%82%C4%85czanie%20obs%C5%82ugi%20ciasteczek\" rel=\"noreferrer noopener\">Instrukcja dot. zablokowania plików cookie w Firefoxie</a></li>\n<li><a target=\"_blank\" href=\"http://windows.microsoft.com/pl-pl/windows7/block-enable-or-allow-cookies\" rel=\"noreferrer noopener\">Instrukcja dot. zablokowania plików cookie w IE</a></li>\n<li><a target=\"_blank\" href=\"http://help.opera.com/Windows/12.10/pl/cookies.html\" rel=\"noreferrer noopener\">Instrukcja dot. zablokowania plików cookie w Operze</a></li>\n<li><a target=\"_blank\" href=\"http://support.apple.com/kb/PH5042\" rel=\"noreferrer noopener\">Instrukcja dot. zablokowania plików cookie w Safari</a></li>\n</ul>', 'politka-prywatnosci'),
(13, 1, 1, 'Kontakt z nami', 'Kontakt i wsparcie techniczne sklepów internetowych', '', '', '<h2 style=\"text-align:center;\">Biuro Obsługi Klienta i Pomoc Techniczna</h2>\r\n<p style=\"text-align:center;\">czynne od 10:00 do 20:00 <strong><span style=\"color:#d60303;\">7 dni</span> </strong>w tygodniu</p>\r\n<p style=\"text-align:center;\"></p>\r\n<p style=\"text-align:center;\"></p>\r\n<p style=\"text-align:center;\">FSHOP.pl</p>\r\n<p style=\"text-align:center;\">Dane adresowe...</p>', 'kontakt-z-nami');
