(19, 1, 1, 'Produkt - dlaczego warto', '', '', '', '<p><img src=\"https://localhost/fshop/img/cms/bestglass.png\" alt=\"\" width=\"1120\" height=\"124\" /></p>\r\n<p style=\"text-align:justify;\">Zapraszamy do naszego sklepu internetowego, gdzie znajdziesz produkty najwyższej jakości od polskiego producenta. Wspierając lokalne przedsiębiorstwa, wybierasz produkty tworzone z pasją i dbałością o każdy detal. Nasze wyroby charakteryzują się nie tylko wyjątkowym designem, ale także trwałością i funkcjonalnością. Kupując u nas, masz pewność, że wybierasz produkty, które powstają z poszanowaniem tradycji i najnowszych technologii. Dołącz do grona zadowolonych klientów i ciesz się zakupami wspierającymi polską gospodarkę!</p>', 'produkt-dlaczego-warto'),
(20, 1, 1, 'Jesteśmy otwarci!', 'Przywitaj się z nowymi możliwościami zakupów online!', 'Otwarcie sklepu internetowego', '14-05-2024', '<div class=\"custom--blog\">\r\n<p style=\"border:0px solid #e3e3e3;margin:1.25em 0px;color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;text-align:left;\"><img src=\"https://localhost/fshop/img/cms/home-p22.png\" alt=\"mobile-www\" width=\"279\" height=\"331\" /></p>\r\n<p style=\"border:0px solid #e3e3e3;margin:1.25em 0px;color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;text-align:left;\">Z ogromną radością ogłaszamy otwarcie naszego nowego sklepu internetowego! Jesteśmy tutaj, aby zaoferować Ci wyjątkowy wybór produktów w najlepszych cenach. Odkryj naszą szeroką gamę nowości i skorzystaj z atrakcyjnych promocji na start. </p>\r\n<p style=\"border:0px solid #e3e3e3;margin:1.25em 0px;color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;text-align:left;\"><strong> Kontakt i godziny otwarcia:</strong> Nasz zespół obsługi klienta jest do Twojej dyspozycji 7 dni w tygodniu, od 8:00 do 20:00. Skontaktuj się z nami przez email: <a style=\"border:0px solid #e3e3e3;\">kontakt@naszsklep.pl</a> lub telefon: 123 456 789.</p>\r\n</div>', 'jestesmy-otwarci'),
(21, 1, 1, 'Nowy produkt w ofercie', 'Lataj wyżej i dalej z najnowszym modelem drona!', '', '23-05-2023', '<div class=\"custom--blog\">\r\n<p><span style=\"color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\"><img src=\"https://localhost/fshop/img/cms/drone2.jpg\" alt=\"dron\" width=\"1080\" height=\"800\" /></span></p>\r\n<p><span style=\"color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\">Jesteśmy dumni, że możemy zaprezentować nasz flagowy produkt – nowoczesny dron, który definiuje nowe standardy w branży technologicznej. Wyposażony w zaawansowane funkcje takie jak automatyczne śledzenie, stabilizacja obrazu oraz długi czas lotu, nasz dron jest idealnym wyborem dla entuzjastów technologii i profesjonalnych filmowców. </span></p>\r\n<p><span style=\"color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\">Dzięki intuicyjnemu interfejsowi użytkownika i niezrównanej jakości wykonania, nasz dron jest przygotowany, aby towarzyszyć Ci w każdej przygodzie.</span></p>\r\n</div>', 'nowy-produkt-w-ofercie'),
(22, 1, 1, 'Promocje tygodnia', 'Oszczędzaj więcej z naszymi ekskluzywnymi ofertami!', 'Promocje tygodnia', '19-05-2024', '<div class=\"custom--blog\">\r\n<p><span style=\"color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\"><img src=\"https://localhost/fshop/img/cms/piggy.jpg\" alt=\"skarbonka\" width=\"654\" height=\"403\" /></span></p>\r\n<p><span style=\"color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\">Zachęcamy do regularnego odwiedzania naszej strony, gdzie co tydzień prezentujemy nowe promocje, które pozwolą Ci znacznie obniżyć koszty zakupów. Od elektroniki po artykuły gospodarstwa domowego, nasze obniżki obejmują szeroki zakres produktów. </span></p>\r\n<p><span style=\"color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\">To świetna okazja, by zaktualizować swoje urządzenia lub wzbogacić dom o nowe gadżety bez nadwyrężania portfela. Każda promocja jest starannie dobierana, aby dostarczać naszym klientom najlepszej wartości.</span></p>\r\n<div></div>\r\n</div>', 'promocje-tygodnia'),
(23, 1, 1, 'Zapraszamy do kontaktu', 'Zapraszamy do kontaktu', 'Masz pytania? Nasz zespół obsługi klienta chętnie na nie odpowie.', '15-05-2024', '<div class=\"custom--blog\"><span style=\"color:#0d0d0d;font-family:\'Söhne\', \'ui-sans-serif\', \'system-ui\', \'-apple-system\', \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\';font-size:16px;background-color:#ffffff;\"><img src=\"https://localhost/fshop/img/cms/39012111_l_normal_none.jpg\" alt=\"kontakt\" width=\"1707\" height=\"2561\" /></span></div>\r\n<div class=\"custom--blog\">\r\n<p class=\"MsoNormal\">Nasza dedykowana obsługa klienta jest zawsze gotowa, by odpowiedzieć na Twoje pytania i rozwiać wszelkie wątpliwości.</p><p></p>\r\n<p class=\"MsoNormal\">Niezależnie od tego, czy szukasz porady dotyczącej wyboru produktów, czy potrzebujesz wsparcia technicznego, nasi eksperci są tutaj, aby zapewnić Ci szybką i rzetelną pomoc. Staramy się, aby każda interakcja z naszym sklepem była pozytywnym doświadczeniem, które przyczynia się do budowania długotrwałych relacji z naszymi klientami.</p><p></p>\r\n<p class=\"MsoNormal\">Kontakt i godziny otwarcia: Nasz zespół obsługi klienta jest do Twojej dyspozycji 7 dni w tygodniu, od 8:00 do 20:00. Skontaktuj się z nami przez email: kontakt@naszsklep.pl lub telefon: 123 456 789.</p><p></p>\r\n</div>', 'zapraszamy-do-kontaktu');
