INSERT INTO `ps_info_lang` (`id_info`, `id_shop`, `id_lang`, `text`) VALUES
(1, 1, 1, '<div class=\"art__list col--2\">\r\n<div class=\"art art--pic\"><img src=\"https://localhost/fshop/img/cms/polacy.jpg\" alt=\"\" width=\"800\" height=\"530\" /></div>\r\n<div class=\"art art--txt\">\r\n<h2 class=\"h2\">Opowiedz nam o swojej firmie!</h2>\r\n<p>Umieszczenie krótkich informacji o swojej firmie na stronie internetowej sklepu może znacząco wpłynąć na wzrost dochodów. Przede wszystkim, klientom daje to poczucie zaufania. Kiedy potencjalny klient widzi, że za sklepem stoi prawdziwa firma, a nie anonimowy sprzedawca, chętniej zdecyduje się na zakupy. Warto zawrzeć podstawowe informacje, takie jak historia firmy, jej misja oraz wartości, którymi się kieruje.</p>\r\n<p>Krótki opis może również zawierać informacje o produktach lub usługach oferowanych przez firmę, co pozwoli klientom lepiej zrozumieć, dlaczego warto wybrać właśnie ten sklep. Dodatkowo, podanie danych kontaktowych oraz lokalizacji firmy może być kluczowe dla tych, którzy preferują osobisty kontakt lub odbiór towaru.</p>\r\n</div>\r\n</div>');
