INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`, `my_extra_field_description`) VALUES
(213, 1, 1, '', '<p><strong>1. Zestaw 5 Misiów \"Teddy Friends\"</strong></p>\r\n<p>\"Teddy Friends\" to zestaw pięciu uroczych pluszowych misiów, idealnych do zabawy i przytulania. Każdy miś w zestawie ma unikalny design i kolor, dzięki czemu dzieci mogą cieszyć się różnorodnością swoich nowych przyjaciół.</p>\r\n<ul>\r\n<li><span>Liczba misiów:</span> 5</li>\r\n<li><span>Kolory:</span> Beżowy, brązowy, biały, szary, różowy</li>\r\n<li><span>Wysokość:</span> Każdy miś ma około 20 cm wysokości</li>\r\n<li><span>Materiał:</span> Miękki, hipoalergiczny plusz, bezpieczny dla dzieci</li>\r\n<li><span>Dodatki:</span> Każdy miś ma uroczy szalik lub kokardę</li>\r\n<li><span>Zastosowanie:</span> Idealny na prezent, do zabawy oraz jako dekoracja pokoju dziecięcego</li>\r\n</ul>\r\n<p><strong>2. Pluszowy Miś \"Classic Teddy\"</strong></p>\r\n<p>\"Classic Teddy\" to pojedynczy, klasyczny pluszowy miś, który będzie doskonałym towarzyszem dla każdego dziecka. Jego tradycyjny design i miękkość sprawiają, że jest ulubieńcem zarówno dzieci, jak i dorosłych.</p>\r\n<ul>\r\n<li><span>Kolor:</span> Jasnobrązowy</li>\r\n<li><span>Wysokość:</span> 30 cm</li>\r\n<li><span>Materiał:</span> Wysokiej jakości plusz, bardzo miękki w dotyku</li>\r\n<li><span>Dodatki:</span> Czerwona kokarda na szyi</li>\r\n<li><span>Zastosowanie:</span> Idealny na prezent, do zabawy, przytulania oraz jako pamiątka</li>\r\n</ul>\r\n<p><strong>3. Pluszowy Stworek \"Fuzzy Buddy\"</strong></p>\r\n<p>\"Fuzzy Buddy\" to zabawny i kolorowy pluszowy stworek, który rozjaśni każdy dzień swoim niepowtarzalnym wyglądem i miękkością. To idealny wybór dla dzieci, które uwielbiają nietypowe zabawki.</p>\r\n<ul>\r\n<li><span>Kolor:</span> Zielony z fioletowymi akcentami</li>\r\n<li><span>Wysokość:</span> 25 cm</li>\r\n<li><span>Materiał:</span> Miękki, pluszowy materiał, przyjemny w dotyku</li>\r\n<li><span>Dodatki:</span> Długie uszy, które można wyginać</li>\r\n<li><span>Zastosowanie:</span> Idealny do zabawy, przytulania oraz jako dekoracja pokoju dziecięcego</li>\r\n</ul>\r\n<p><strong>4. Minionek z Małym Misiem \"Minion &amp; Teddy\"</strong></p>\r\n<p>\"Minion &amp; Teddy\" to uroczy pluszak przedstawiający popularnego Minionka z jego małym, pluszowym misiem. To doskonały wybór dla fanów filmu \"Minionki\" i ich przygód.</p>\r\n<ul>\r\n<li><span>Kolor:</span> Żółty Minionek z brązowym misiem</li>\r\n<li><span>Wysokość:</span> 25 cm</li>\r\n<li><span>Materiał:</span> Miękki plusz, bezpieczny dla dzieci</li>\r\n<li><span>Dodatki:</span> Minionek trzyma małego misia w ramionach</li>\r\n<li><span>Zastosowanie:</span> Idealny na prezent, do zabawy oraz jako kolekcjonerski gadżet</li>\r\n</ul>\r\n<p><strong>5. Miś z Kopertą Walentynkową \"Love Bear\"</strong></p>\r\n<p>\"Love Bear\" to romantyczny pluszowy miś trzymający kopertę walentynkową. To idealny prezent na Walentynki, który wyrazi uczucia w uroczy sposób.</p>\r\n<ul>\r\n<li><span>Kolor:</span> Beżowy miś</li>\r\n<li><span>Wysokość:</span> 20 cm</li>\r\n<li><span>Materiał:</span> Miękki, przytulny plusz</li>\r\n<li><span>Dodatki:</span> Czerwona koperta z serduszkiem, którą miś trzyma w łapkach</li>\r\n<li><span>Zastosowanie:</span> Idealny na prezent walentynkowy, do dekoracji oraz jako symbol miłości</li>\r\n</ul>', 'misie-na-kazda-okazje', '', '', '', 'Misie na każdą okazję', '', '', '', '', NULL),
(218, 1, 1, '', '<p>\"Speedy Racer\" to idealna zabawka dla najmłodszych miłośników motoryzacji. Dostępne w trzech żywych kolorach, to autko jest zaprojektowane tak, aby dostarczyć wiele radości i wspierać rozwój wyobraźni dziecka.</p>\r\n<ul>\r\n<li><span>Kolory:</span> Żółty, niebieski, beżowy</li>\r\n<li><span>Rozmiar:</span> Kompaktowy, idealny dla małych rączek</li>\r\n<li><span>Materiał:</span> Wysokiej jakości, bezpieczny plastik, odporny na uszkodzenia</li>\r\n<li><span>Wymiary:</span> 15 cm długości, 8 cm szerokości, 6 cm wysokości</li>\r\n<li><span>Cechy:</span>\r\n<ul>\r\n<li><span>Bezpieczeństwo:</span> Zaokrąglone krawędzie, aby zapobiec zranieniom</li>\r\n<li><span>Mobilność:</span> Obrotowe kółka, które pozwalają na płynne poruszanie się po różnych powierzchniach</li>\r\n<li><span>Design:</span> Uroczy, przyjazny wygląd z oczkami na przedniej szybie, który zachwyci każde dziecko</li>\r\n</ul>\r\n</li>\r\n<li><span>Zastosowanie:</span> Idealne do zabawy w domu, na podwórku lub w parku</li>\r\n<li><span>Zalety:</span>\r\n<ul>\r\n<li><span>Rozwój:</span> Wspiera rozwój motoryczny i koordynację ruchową dziecka</li>\r\n<li><span>Wyobraźnia:</span> Zachęca do kreatywnej zabawy i tworzenia własnych przygód</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><span>Żółty \"Speedy Racer\"</span></p>\r\n<ul>\r\n<li><span>Opis:</span> Jasny, słoneczny żółty kolor, który przyciąga wzrok i dodaje energii do każdej zabawy.</li>\r\n</ul>\r\n<p><span>Niebieski \"Speedy Racer\"</span></p>\r\n<ul>\r\n<li><span>Opis:</span> Głęboki, niebieski kolor przypominający bezchmurne niebo, idealny dla małych odkrywców, którzy uwielbiają spędzać czas na świeżym powietrzu.</li>\r\n</ul>\r\n<p><span>Beżowy \"Speedy Racer\"</span></p>\r\n<ul>\r\n<li><span>Opis:</span> Stonowany, elegancki beżowy kolor, który pasuje do każdego otoczenia i wnętrza, idealny dla dzieci ceniących spokojne, klasyczne odcienie.</li>\r\n</ul>\r\n<br /><span>Każdy z tych kolorów sprawia, że \"Speedy Racer\" jest nie tylko zabawką, ale także pięknym dodatkiem do kolekcji dziecka. Wybierz kolor, który najlepiej pasuje do Twojego malucha, i podaruj mu radość z jazdy!</span>', 'autko-speedy-racer', '', '', '', 'Autko \"Speedy Racer\"', '', '', '', '', NULL),
(219, 1, 1, '', '<p>Wygodne i stylowe jeansowe szorty z przetarciami, które dodadzą Twojej garderobie młodzieńczego i modnego charakteru. Wykonane z wysokiej jakości denimu, zapewniającego trwałość i komfort noszenia przez cały dzień. Szorty mają klasyczny, nieco dopasowany krój, który podkreśla sylwetkę, a jednocześnie pozwala na swobodę ruchów.</p>\r\n<p>Charakterystyczne przetarcia i dziury na nogawkach nadają im odważnego, nieco buntowniczego wyglądu, idealnego na letnie festiwale, spontaniczne wyjścia z przyjaciółmi czy codzienne aktywności. Dodatkowo, szorty wyposażone są w pięć funkcjonalnych kieszeni – dwie z przodu, dwie z tyłu oraz jedną małą, co czyni je praktycznym wyborem na co dzień.</p>\r\n<p>Zapinane na zamek błyskawiczny i guzik, łatwo dopasowują się do sylwetki, a szlufki na pasek pozwalają na dodatkowe stylizacyjne eksperymenty. Ich uniwersalny niebieski kolor sprawia, że doskonale komponują się zarówno z t-shirtami, jak i eleganckimi bluzkami, dając nieograniczone możliwości tworzenia różnych letnich stylizacji.</p>\r\n<p>Jeansowe szorty z przetarciami to must-have na ciepłe dni, kiedy chcesz czuć się modnie i komfortowo.<br /><br />Dostępne w wielu kolorach i rozmiarach.</p>', 'spodenki-krotkie-wiosnalato', '', '', '', 'Spodenki krótkie wiosna/lato', '', '', '', '', NULL),
(220, 1, 1, '', '<p>Odkryj skórzaną torebkę \"Timeless Style\" w przygaszonym odcieniu jasnego brązu, idealną dla kobiet, które cenią klasyczny wygląd i funkcjonalność. Ta elegancka torebka o rozmiarze A4 została wykonana z najwyższej jakości skóry naturalnej, oferując połączenie stylu i praktyczności.</p>\r\n<ul>\r\n<li><span>Materiał:</span> Skóra naturalna</li>\r\n<li><span>Wymiary:</span> 30 cm (wysokość) x 35 cm (szerokość) x 10 cm (głębokość)</li>\r\n<li><span>Kolor:</span> Przygaszony jasnobrązowy</li>\r\n<li><span>Zapięcie:</span> Zamek błyskawiczny</li>\r\n<li><span>Wnętrze:</span> Przestronna główna komora mieszcząca dokumenty w formacie A4, dodatkowa kieszonka na telefon i klucze</li>\r\n<li><span>Rączka:</span> Regulowana, umożliwiająca noszenie torebki na ramieniu lub w ręce</li>\r\n</ul>\r\n<p>Jasnobrązowa torebka \"Timeless Style\" to doskonały wybór na każdy dzień oraz do pracy. Dzięki swojemu klasycznemu wyglądowi i praktycznym rozmiarom, jest idealna do noszenia dokumentów, laptopa i innych niezbędnych rzeczy, jednocześnie dodając szyku każdej stylizacji.<br /><br />Dostępna również w innych kolorach.</p>', 'skorzana-torebka-timeless-style', '', '', '', 'Skórzana Torebka \"Timeless Style\"', '', '', '', '', NULL),
(222, 1, 1, '', '<p>Wyróżnij swój styl elegancją i ponadczasowym wdziękiem dzięki naszemu klasycznemu zegarkowi męskiemu. Ten wyrafinowany czasomierz to połączenie precyzji, funkcjonalności i niezawodności, której możesz zaufać w każdej sytuacji. Zegarek ten prezentuje się nie tylko wyjątkowo stylowo, ale także charakteryzuje się solidną konstrukcją, która zapewnia trwałość i niezawodność przez wiele lat.</p>\r\n<h3>Cechy zegarka:</h3>\r\n<ol>\r\n<li>\r\n<p><span>Klasyczny design:</span> Zegarek posiada klasyczny design, który nigdy nie wychodzi z mody. Zegarek ten jest ponadczasowy i doskonale pasuje do różnych stylizacji, od formalnych po casualowe.</p>\r\n</li>\r\n<li>\r\n<p><span>Solidna koperta:</span> Koperta zegarka wykonana jest z wysokiej jakości stali nierdzewnej lub innego trwałego materiału, który zapewnia ochronę mechanizmu zegara oraz wytrzymałość na codzienne użytkowanie.</p>\r\n</li>\r\n<li>\r\n<p><span>Clear dial:</span> Zegarek posiada czytelny i przejrzysty cyferblat z wyraźnymi wskaźnikami godzin, minut i sekund oraz datownikiem. To sprawia, że czas odczytuje się łatwo i szybko nawet w szybkim ruchu.</p>\r\n</li>\r\n<li>\r\n<p><span>Mechanizm kwarcowy lub automatyczny:</span> Zegarek wyposażony jest w precyzyjny mechanizm kwarcowy lub automatyczny, który zapewnia dokładność wskazań czasu oraz niezawodną pracę.</p>\r\n</li>\r\n<li>\r\n<p><span>Paski do wyboru:</span> Zegarek może być wyposażony w pasek ze skóry naturalnej, stalowy pasek jubilerski lub pasek z innego materiału, co pozwala dopasować zegarek do indywidualnych preferencji i stylu.</p>\r\n</li>\r\n</ol>\r\n<h3>Zalety zegarka:</h3>\r\n<ul>\r\n<li><span>Elegancja i styl:</span> Klasyczny design zegarka dodaje elegancji i szyku do każdej stylizacji, podkreślając indywidualny charakter noszącego.</li>\r\n<li><span>Trwałość:</span> Solidna konstrukcja i wysokiej jakości materiały zapewniają trwałość i niezawodność zegarka przez wiele lat użytkowania.</li>\r\n<li><span>Funkcjonalność:</span> Zegarek nie tylko informuje o czasie, ale także może posiadać dodatkowe funkcje, takie jak datownik, stoper czy wodoszczelność, co czyni go praktycznym narzędziem dla aktywnego mężczyzny.</li>\r\n</ul>', 'klasyczny-zegarek', '', '', '', 'Klasyczny zegarek', '', '', '', '', NULL),
(223, 1, 1, '', '<div class=\"flex flex-grow flex-col max-w-full\">\r\n<div class=\"min-h-[20px] text-message flex flex-col items-start whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 juice:w-full juice:items-end overflow-x-auto gap-2\">\r\n<div class=\"flex w-full flex-col gap-1 juice:empty:hidden juice:first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>Nasze trampki z motywem superbohaterów to idealne połączenie wygody, stylu i odrobiny fantazji. Stworzone z myślą o miłośnikach komiksów i filmów, te buty oferują nie tylko komfort, ale także możliwość wyrażenia swojego uwielbienia dla ulubionych postaci.</p>\r\n<ul>\r\n<li><span>Marka:</span> Snickersy</li>\r\n<li><span>Kolor:</span> Wielobarwne z motywem superbohaterów</li>\r\n<li><span>Typ:</span> Trampki sportowe</li>\r\n<li><span>Materiał zewnętrzny:</span> Wytrzymała, oddychająca tkanina tekstylna, zapewniająca przewiewność i wygodę</li>\r\n<li><span>Podeszwa:</span> Elastyczna, gumowa podeszwa, która zapewnia doskonałą przyczepność i trwałość</li>\r\n<li><span>Wyściółka:</span> Miękka wyściółka wewnętrzna, która amortyzuje stopę i zapewnia komfort przez cały dzień</li>\r\n<li><span>System wiązania:</span> Tradycyjne sznurowadła, umożliwiające łatwe dopasowanie butów do stopy</li>\r\n<li><span>Wzór:</span> Kolorowe grafiki przedstawiające popularnych superbohaterów, takich jak Spider-Man, Batman, Superman czy Wonder Woman, dodające butom charakteru i oryginalności</li>\r\n<li><span>Zastosowanie:</span> Idealne do codziennego noszenia, na spacer, do szkoły, czy na aktywne zabawy na świeżym powietrzu</li>\r\n</ul>\r\n<p>Te trampki to doskonały wybór dla młodzieży i dorosłych, którzy chcą dodać odrobinę magii do swojego codziennego życia. Poczuj się jak prawdziwy superbohater każdego dnia!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mt-1 flex gap-3 empty:hidden juice:-ml-3\">\r\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\r\n<div class=\"flex items-center\"><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span>\r\n<div class=\"flex\"></div>\r\n<div class=\"flex items-center pb-0.5 juice:pb-0\"></div>\r\n</div>\r\n</div>\r\n</div>', 'wygodne-trampki-snickersy', '', '', '', 'Wygodne trampki Snickersy', '', '', '', '', NULL),
(225, 1, 1, '', '<strong><strong></strong></strong>\r\n<p>Dodaj swojej garderobie odrobinę luksusu z naszymi czarnymi szpilkami \"Amaretto \", które wyróżniają się eleganckim złotym czubkiem. Te wyrafinowane buty są idealnym wyborem dla kobiet ceniących sobie klasykę z nutą nowoczesności.</p>\r\n<ul>\r\n<li><span>Materiał:</span> Wysokiej jakości skóra naturalna</li>\r\n<li><span>Kolor:</span> Klasyczna czerń z metalicznym złotym czubkiem</li>\r\n<li><span>Obcas:</span> 10 cm, smukły szpilka, zapewniający elegancję i wyrafinowany wygląd</li>\r\n<li><span>Wnętrze:</span> Wyściółka z miękkiej skóry, zapewniająca komfort noszenia przez cały dzień</li>\r\n<li><span>Podeszwa:</span> Wykonana z trwałego materiału, zapewniającego dobrą przyczepność</li>\r\n</ul>\r\nDługości wkładek dla rozmiarów 36-41: <br /><br />\r\n<table>\r\n<thead>\r\n<tr><th>Rozmiar EU</th><th>Długość wkładki (cm)</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>36</td>\r\n<td>23,0 cm</td>\r\n</tr>\r\n<tr>\r\n<td>37</td>\r\n<td>23,5 cm</td>\r\n</tr>\r\n<tr>\r\n<td>38</td>\r\n<td>24,0 cm</td>\r\n</tr>\r\n<tr>\r\n<td>39</td>\r\n<td>25,0 cm</td>\r\n</tr>\r\n<tr>\r\n<td>40</td>\r\n<td>25,5 cm</td>\r\n</tr>\r\n<tr>\r\n<td>41</td>\r\n<td>26,0 cm</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3></h3>\r\n<p>Czarne szpilki \"Amaretto\" są idealne na eleganckie wieczory, biznesowe spotkania czy specjalne okazje, gdzie chcesz wyglądać olśniewająco. Złoty czubek dodaje im wyjątkowego charakteru, podkreślając Twoją pewność siebie i styl. Niezależnie od tego, czy zestawisz je z wieczorową sukienką, czy eleganckim garniturem, te szpilki z pewnością przyciągną wzrok i zrobią wrażenie.<br /><br /></p>', 'czarne-szpilki-amaretto-', '', '', '', 'Czarne Szpilki Amaretto', '', '', '', '', NULL),
(226, 1, 1, '', '<p>Sportowe buty \"FlexRunner\" to doskonałe połączenie funkcjonalności, komfortu i stylu, dostępne w trzech energetycznych kolorach: niebieskim, różowym i zielonym. Zaprojektowane z myślą o aktywnych osobach, te buty są idealne do różnych form aktywności fizycznej, a także do codziennego noszenia.</p>\r\n<ul>\r\n<li><span>Marka:</span> FlexRunner</li>\r\n<li><span>Kolor:</span> Niebieski / Różowy / Zielony</li>\r\n<li><span>Typ:</span> Sportowe buty treningowe</li>\r\n<li><span>Materiał zewnętrzny:</span> Lekka, oddychająca siateczka tekstylna, zapewniająca wentylację i wygodę</li>\r\n<li><span>Podeszwa:</span> Elastyczna podeszwa środkowa z pianki EVA, która amortyzuje wstrząsy i zapewnia komfort podczas każdego kroku</li>\r\n<li><span>Wyściółka:</span> Miękka, tekstylna wyściółka, która dopasowuje się do stopy, zapewniając wsparcie i wygodę przez cały dzień</li>\r\n<li><span>System wiązania:</span> Tradycyjne sznurowadła, które pozwalają na idealne dopasowanie butów do stopy</li>\r\n<li><span>Podeszwa zewnętrzna:</span> Wytrzymała, gumowa podeszwa zewnętrzna zapewnia doskonałą przyczepność na różnych nawierzchniach, idealna do biegania, treningów i aktywności na świeżym powietrzu</li>\r\n<li><span>Stylowy design:</span> Nowoczesny, dynamiczny wygląd, który przyciąga uwagę, z kolorowymi akcentami, które dodają energii i stylu każdej stylizacji</li>\r\n<li><span>Zastosowanie:</span> Doskonałe do biegania, treningów na siłowni, zajęć fitness oraz codziennego noszenia</li>\r\n</ul>\r\n<p>Nasze sportowe buty \"FlexRunner\" to idealny wybór dla osób, które szukają wygodnych, trwałych i stylowych butów do różnych form aktywności fizycznej. Wybierz swój ulubiony kolor – niebieski, różowy lub zielony – i ciesz się komfortem oraz wsparciem na każdym kroku!</p>', 'sportowe-buty-flexrunner', '', '', '', 'Sportowe Buty \"FlexRunner\"', '', '', '', '', NULL),
(227, 1, 1, '', '<p>Poznaj skórzaną torebkę \"Classic Charm\" w przygaszonym odcieniu czerwieni, idealną dla kobiet ceniących styl i funkcjonalność. Ta elegancka torebka o rozmiarze A4 została wykonana z najwyższej jakości skóry naturalnej, łącząc klasyczny design z praktycznością.</p>\r\n<ul>\r\n<li><span>Materiał:</span> Skóra naturalna</li>\r\n<li><span>Wymiary:</span> 30 cm (wysokość) x 35 cm (szerokość) x 10 cm (głębokość)</li>\r\n<li><span>Kolor:</span> Przygaszona czerwień</li>\r\n<li><span>Zapięcie:</span> Zamek błyskawiczny</li>\r\n<li><span>Wnętrze:</span> Przestronna główna komora mieszcząca dokumenty w formacie A4, dodatkowa kieszonka na telefon i klucze</li>\r\n<li><span>Rączka:</span> Regulowana, umożliwiająca noszenie torebki na ramieniu lub w ręce</li>\r\n</ul>\r\n<p>Ta czerwona torebka \"Classic Charm\" jest doskonałym wyborem na co dzień oraz do pracy. Dzięki swojemu klasycznemu wyglądowi i praktycznym rozmiarom, idealnie nadaje się do noszenia dokumentów, laptopa i innych niezbędnych rzeczy, jednocześnie dodając elegancji każdej stylizacji.</p>', 'skorzana-torebka-classic-charm', '', '', '', 'Skórzana Torebka \"Classic Charm\"', '', '', '', '', NULL),
(232, 1, 1, '', '<p>Wprowadź do swojego domu wyrafinowaną elegancję i świeżość natury dzięki naszym kwiatom dekoracyjnym. Te piękne i kolorowe kwiaty są doskonałym sposobem na dodanie uroku i życia do każdego wnętrza, bez konieczności dbania o ich pielęgnację. Wykonane z najwyższej jakości materiałów, nasze sztuczne kwiaty są nie tylko trwałe, ale także niezwykle realistyczne, imitując prawdziwe kwiaty w najdrobniejszych szczegółach.</p>\r\n<h3>Cechy kwiatów:</h3>\r\n<ol>\r\n<li>\r\n<p><span>Naturalny wygląd:</span> Kwiaty dekoracyjne wyglądają tak realistycznie, że można je łatwo pomylić z prawdziwymi. Ich delikatne płatki, soczyste kolory i realistyczne tekstury sprawiają, że wyglądają one świeże i piękne przez długie lata.</p>\r\n</li>\r\n<li>\r\n<p><span>Wielofunkcyjność:</span> Nasze kwiaty dekoracyjne są wielofunkcyjne i mogą być używane w różnych celach dekoracyjnych. Doskonale sprawdzają się jako ozdoba na stole, parapecie, półce, czy jako element aranżacji wnętrza w wazonie lub koszu.</p>\r\n</li>\r\n<li>\r\n<p><span>Trwałość:</span> Wykonane z wysokiej jakości materiałów, nasze kwiaty są odporne na blaknięcie, uszkodzenia i wilgoć, co sprawia, że będą zachwycać swoim pięknem przez wiele lat.</p>\r\n</li>\r\n<li>\r\n<p><span>Łatwa pielęgnacja:</span> Kwiaty dekoracyjne nie wymagają podlewania, przycinania ani specjalnej pielęgnacji, co sprawia, że są doskonałą opcją dla osób, które nie mają czasu na dbanie o prawdziwe rośliny.</p>\r\n</li>\r\n</ol>\r\n<h3>Zalety kwiatów:</h3>\r\n<ul>\r\n<li><span>Piękno przez cały rok:</span> Nasze kwiaty dekoracyjne pozwalają cieszyć się pięknem kwiatów przez cały rok, niezależnie od pory roku czy warunków atmosferycznych.</li>\r\n<li><span>Oszczędność czasu i pieniędzy:</span> Sztuczne kwiaty są ekonomiczną alternatywą dla świeżych kwiatów, ponieważ nie trzeba ich regularnie wymieniać ani pielęgnować.</li>\r\n<li><span>Dekoracyjna różnorodność:</span> Dostępne są w szerokim wyborze gatunków, kolorów i rozmiarów, co pozwala dopasować je do każdego stylu i aranżacji wnętrza.</li>\r\n</ul>', 'kwiaty-dekoracyjne', '', '', '', 'Kwiaty dekoracyjne', '', '', '', '', NULL),
(234, 1, 1, '<h2>Przykładowy opis</h2>\r\n<strong>Lorem Ipsum</strong><span> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span>', '<div class=\"flex flex-grow flex-col max-w-full\">\r\n<div class=\"min-h-[20px] text-message flex flex-col items-start whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 juice:w-full juice:items-end overflow-x-auto gap-2\">\r\n<div class=\"flex w-full flex-col gap-1 juice:empty:hidden juice:first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>Pozwól sobie na odrobinę luksusu z naszą szminką Deluxe Lipstick, dostępną w szerokiej gamie odcieni, aby idealnie dopasować się do każdej karnacji i okazji. Każda szminka została stworzona z myślą o kobietach, które pragną podkreślić swoje naturalne piękno, dodając ustom wyrazistości i koloru.</p>\r\n<h4>Odcień „Classic Red”</h4>\r\n<p>Wyjątkowo intensywna czerwień, która sprawi, że Twoje usta staną się centralnym punktem każdej stylizacji. „Classic Red” to idealny wybór na wieczorne wyjścia, randki i specjalne okazje, gdzie chcesz olśniewać swoim wyglądem.</p>\r\n<h4>Odcień „Nude Elegance”</h4>\r\n<p>Delikatny, beżowy odcień idealny na co dzień. „Nude Elegance” subtelnie podkreśla naturalny kolor ust, nadając im zdrowy i świeży wygląd. To doskonały wybór do biura, na spotkania biznesowe oraz na codzienne wyjścia.</p>\r\n<h4>Odcień „Rosy Pink”</h4>\r\n<p>Różany róż to odcień, który dodaje uroku i dziewczęcego wdzięku. „Rosy Pink” to idealny wybór na romantyczne randki, spotkania z przyjaciółmi oraz na wiosenne i letnie dni, kiedy chcesz wyglądać świeżo i promiennie.</p>\r\n<h4>Odcień „Berry Bliss”</h4>\r\n<p>Głęboki, jagodowy odcień dla odważnych kobiet, które lubią eksperymentować z kolorami. „Berry Bliss” dodaje ustom tajemniczości i intensywności, świetnie sprawdza się podczas wieczornych wyjść i eleganckich przyjęć.</p>\r\n<h4>Odcień „Coral Charm”</h4>\r\n<p>Świeży, koralowy odcień, który wprowadza letnią energię do każdej stylizacji. „Coral Charm” jest idealnym wyborem na wakacyjne wyjazdy, letnie imprezy i wszędzie tam, gdzie chcesz poczuć się lekko i radośnie.</p>\r\n<h3>Właściwości Szminki Deluxe Lipstick</h3>\r\n<ul>\r\n<li><span>Długotrwała formuła:</span> Nasze szminki zapewniają intensywny kolor przez wiele godzin, bez potrzeby częstego poprawiania makijażu.</li>\r\n<li><span>Kremowa konsystencja:</span> Łatwo się aplikuje, zapewniając gładkie i równomierne pokrycie ust.</li>\r\n<li><span>Nawilżenie i pielęgnacja:</span> Formuła wzbogacona o witaminy i składniki nawilżające, które dbają o zdrowie Twoich ust, zapobiegając ich przesuszeniu.</li>\r\n<li><span>Eleganckie opakowanie:</span> Każda szminka zapakowana jest w eleganckie, metaliczne etui, które doda luksusu każdemu makijażowemu niezbędnikowi.</li>\r\n</ul>\r\n<p>Odkryj wszystkie odcienie naszej szminki Deluxe Lipstick i znajdź ten, który najlepiej pasuje do Twojego stylu i nastroju. Niezależnie od wyboru, możesz być pewna, że Twoje usta będą wyglądały pięknie, zdrowo i pełne koloru przez cały dzień.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mt-1 flex gap-3 empty:hidden juice:-ml-3\">\r\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\r\n<div class=\"flex items-center\"><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span>\r\n<div class=\"flex\"></div>\r\n<div class=\"flex items-center pb-0.5 juice:pb-0\"></div>\r\n</div>\r\n</div>\r\n</div>', 'szminka-deluxe-lipstick-rozne-odcienie', '', '', '', 'Szminka Deluxe Lipstick - Różne Odcienie', '', '', '', '', NULL),
(235, 1, 1, '<h2>Przykładowy opis</h2>\r\n<strong>Lorem Ipsum</strong><span> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span>', '<div class=\"flex flex-grow flex-col max-w-full\">\r\n<div class=\"min-h-[20px] text-message flex flex-col items-start whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 juice:w-full juice:items-end overflow-x-auto gap-2\">\r\n<div class=\"flex w-full flex-col gap-1 juice:empty:hidden juice:first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>Nasz zestaw pędzli do makijażu Premium to niezbędnik każdej miłośniczki makijażu, zarówno dla początkujących, jak i dla profesjonalistów. Zestaw składa się z 10 starannie dobranych pędzli, które umożliwią wykonanie pełnego makijażu twarzy z najwyższą precyzją i komfortem.</p>\r\n<h4>Zawartość Zestawu:</h4>\r\n<ol>\r\n<li>\r\n<p><span>Pędzel do pudru</span></p>\r\n<ul>\r\n<li>Miękki, duży pędzel, idealny do nakładania pudru sypkiego i prasowanego. Zapewnia równomierne wykończenie i naturalny wygląd.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel do różu</span></p>\r\n<ul>\r\n<li>Średniej wielkości pędzel z lekko ściętym włosiem, pozwala na precyzyjne nałożenie różu na policzki, podkreślając kości policzkowe.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel do podkładu</span></p>\r\n<ul>\r\n<li>Płaski, syntetyczny pędzel, który zapewnia gładkie i równomierne rozprowadzenie podkładu, bez smug i zacieków.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel do bronzera</span></p>\r\n<ul>\r\n<li>Miękki pędzel o zaokrąglonym kształcie, idealny do aplikacji bronzera i konturowania twarzy.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel do cieni</span></p>\r\n<ul>\r\n<li>Mały, precyzyjny pędzel do aplikacji cieni na powieki, umożliwia dokładne nałożenie koloru i blendowanie.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel do rozcierania cieni</span></p>\r\n<ul>\r\n<li>Puchaty pędzel do blendowania cieni, zapewnia płynne przejścia między kolorami i perfekcyjny smoky eye.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel do brwi</span></p>\r\n<ul>\r\n<li>Kątowy pędzel do aplikacji produktów na brwi, umożliwia precyzyjne wypełnienie i nadanie kształtu brwiom.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel do eyelinera</span></p>\r\n<ul>\r\n<li>Cienki, precyzyjny pędzel do aplikacji eyelinera w żelu lub kremie, idealny do tworzenia cienkich, równych linii.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel do ust</span></p>\r\n<ul>\r\n<li>Mały pędzel do precyzyjnego nakładania szminki lub błyszczyka, zapewnia dokładność i równomierne pokrycie ust.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><span>Pędzel wachlarzowy</span></p>\r\n<ul>\r\n<li>Delikatny pędzel wachlarzowy do usuwania nadmiaru pudru, rozświetlania twarzy lub delikatnego konturowania.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<h3>Cechy i zalety:</h3>\r\n<ul>\r\n<li><span>Wysokiej jakości włosie:</span> Pędzle wykonane z syntetycznego, miękkiego włosia, które jest delikatne dla skóry i łatwe w utrzymaniu czystości.</li>\r\n<li><span>Ergonomiczne rączki:</span> Każdy pędzel posiada wygodną, dobrze wyważoną rączkę, co ułatwia precyzyjną aplikację.</li>\r\n<li><span>Eleganckie etui:</span> Zestaw pędzli zapakowany jest w eleganckie etui, które ułatwia przechowywanie i transport, idealne na podróże.</li>\r\n<li><span>Wszechstronność:</span> Zestaw zawiera wszystkie niezbędne pędzle do wykonania pełnego makijażu, od podkładu po precyzyjne wykończenia.</li>\r\n</ul>\r\n<p>Odkryj komfort i precyzję, jaką daje nasz zestaw pędzli do makijażu Premium, i ciesz się perfekcyjnym makijażem każdego dnia. To doskonały wybór zarówno dla siebie, jak i na prezent dla bliskiej osoby, która uwielbia makijaż.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mt-1 flex gap-3 empty:hidden juice:-ml-3\">\r\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\r\n<div class=\"flex items-center\"><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span>\r\n<div class=\"flex\"></div>\r\n<div class=\"flex items-center pb-0.5 juice:pb-0\"></div>\r\n</div>\r\n</div>\r\n</div>', 'zestaw-pedzli-do-makijazu', '', '', '', 'Zestaw pędzli do makijażu', '', '', '', '', NULL),
(237, 1, 1, '', '<p>Perfumy \"Trésor\" od Lancôme to klasyczna i elegancka kompozycja zapachowa, która od lat zachwyca swoim wyjątkowym aromatem. Oto więcej informacji na temat tego wyjątkowego zapachu:</p>\r\n<ul>\r\n<li><span>Nazwa:</span> Trésor</li>\r\n<li><span>Marka:</span> Lancôme</li>\r\n<li><span>Rodzaj zapachu:</span> Kwiatowy orientalny</li>\r\n<li><span>Główne nuty zapachowe:</span>\r\n<ul>\r\n<li>Nuta głowy: Róże, brzoskwinie, piwonia</li>\r\n<li>Nuta serca: Lilie, jaśmin, fiołek</li>\r\n<li>Nuta bazy: Drzewo sandałowe, bursztyn, piżmo</li>\r\n</ul>\r\n</li>\r\n<li><span>Charakter zapachu:</span> Trésor to perfumy o romantycznym i zmysłowym charakterze, które emanują elegancją i kobiecością. Ich bogata kompozycja kwiatowych i orientalnych nut tworzy niepowtarzalną aurę luksusu i wyrafinowania.</li>\r\n<li><span>Okazja do noszenia:</span> Doskonale sprawdzają się zarówno na co dzień, jak i na specjalne okazje, dodając subtelnego uroku i klasy każdej stylizacji.</li>\r\n<li><span>Opakowanie:</span> Perfumy Trésor często są prezentowane w eleganckim flakonie o klasycznym, prostym kształcie, podkreślającym ich ponadczasowy charakter.</li>\r\n<li><span>Popularność:</span> Trésor od Lancôme to ikoniczny zapach, który zdobył uznanie zarówno wśród krytyków perfumeryjnych, jak i miłośników eleganckich kompozycji zapachowych.</li>\r\n</ul>\r\n<p>Perfumy Trésor to nie tylko zapach, ale także emocje i wspomnienia, które towarzyszą każdemu, kto go nosi. Ich wyjątkowa harmonia sprawia, że są one idealnym wyborem dla kobiet ceniących subtelny luksus i wyrafinowaną kobiecość.</p>', 'perfumy-tresor-od-lancome', '', '', '', 'Perfumy \"Trésor\" od Lancôme', '', '', '', '', NULL),
(246, 1, 1, 'wyjatkowy produkt', '', 'nowy-produkt', '', '', '', 'Nowy produkt', '', '', '', '', NULL),
(248, 1, 1, '', '<p>Przywitaj każdy dzień z ręcznikiem \"Ocean Deep\", który łączy w sobie głębię bordowego i niebieskiego koloru, przypominającą morskie fale. Wykonany z wysokogatunkowej, 100% bawełny, ten ręcznik zapewnia nie tylko wyjątkową miękkość, ale również doskonałą chłonność, co czyni go idealnym towarzyszem zarówno po kąpieli, jak i podczas wizyty na basenie czy plaży.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Materiał:</span> 100% bawełna</li>\r\n<li><span>Rozmiar:</span> 70 cm x 140 cm</li>\r\n<li><span>Kolory:</span> Bordowy i niebieski</li>\r\n<li><span>Pielęgnacja:</span> Możliwość prania w pralce w temperaturze do 40°C</li>\r\n</ul>', 'recznik-bawelniany-ocean-deep', '', '', '', 'Ręcznik Bawełniany \"Ocean Deep\"', '', '', '', '', NULL),
(249, 1, 1, '', '<p>Odkryj magiczny świat zapachów z naszą kolekcją świec \"Aroma Lux\". Każda świeca została stworzona z myślą o zapewnieniu relaksującej atmosfery i dodaniu elegancji każdemu wnętrzu. Wybierz jeden z czterech dostępnych wariantów, aby stworzyć idealne otoczenie dla swoich codziennych i wyjątkowych chwil.</p>\r\n<p><span>Dostępne warianty:</span></p>\r\n<ol>\r\n<li><span>Lavender Bliss</span> - Spokój i relaks z delikatnym zapachem lawendy, idealny na wieczorne odprężenie.</li>\r\n<li><span>Vanilla Dream</span> - Słodki i ciepły zapach wanilii, który wnosi poczucie komfortu do każdego pomieszczenia.</li>\r\n<li><span>Citrus Burst</span> - Orzeźwiający i energetyzujący zapach cytrusów, doskonały na pobudzenie zmysłów.</li>\r\n<li><span>Cedarwood Calm</span> - Głęboki i ziemisty aromat cedru, idealny do stworzenia spokojnej i harmonijnej atmosfery.</li>\r\n</ol>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Materiał:</span> Naturalny wosk sojowy</li>\r\n<li><span>Rozmiar:</span> 150 g</li>\r\n<li><span>Czas palenia:</span> Do 40 godzin</li>\r\n<li><span>Pielęgnacja:</span> Przycinaj knot przed każdym użyciem, aby zoptymalizować czas palenia</li>\r\n</ul>\r\n<p>Nasze świece \"Aroma Lux\" są wykonane z naturalnego wosku sojowego, który gwarantuje czystsze spalanie i dłuższy czas palenia. Idealne jako element dekoracyjny, który wprowadza przyjemną aurę do Twojego domu, oraz jako wyjątkowy prezent dla bliskich.</p>\r\n<div></div>', 'swieca-zapachowa-aroma-lux-lavender-bliss-', '', '', '', 'Świeca Zapachowa \"Aroma Lux\" - Lavender Bliss', '', '', '', '', NULL),
(250, 1, 1, '', '<p>Odkryj magiczny świat zapachów z naszą kolekcją świec \"Aroma Lux\". Każda świeca została stworzona z myślą o zapewnieniu relaksującej atmosfery i dodaniu elegancji każdemu wnętrzu. Wybierz jeden z czterech dostępnych wariantów, aby stworzyć idealne otoczenie dla swoich codziennych i wyjątkowych chwil.</p>\r\n<p>Dostępne warianty:</p>\r\n<ol>\r\n<li>Lavender Bliss - Spokój i relaks z delikatnym zapachem lawendy, idealny na wieczorne odprężenie.</li>\r\n<li>Vanilla Dream - Słodki i ciepły zapach wanilii, który wnosi poczucie komfortu do każdego pomieszczenia.</li>\r\n<li>Citrus Burst - Orzeźwiający i energetyzujący zapach cytrusów, doskonały na pobudzenie zmysłów.</li>\r\n<li>Cedarwood Calm - Głęboki i ziemisty aromat cedru, idealny do stworzenia spokojnej i harmonijnej atmosfery.</li>\r\n</ol>\r\n<p>Specyfikacja:</p>\r\n<ul>\r\n<li>Materiał: Naturalny wosk sojowy</li>\r\n<li>Rozmiar: 150 g</li>\r\n<li>Czas palenia: Do 40 godzin</li>\r\n<li>Pielęgnacja: Przycinaj knot przed każdym użyciem, aby zoptymalizować czas palenia</li>\r\n</ul>\r\n<p>Nasze świece \"Aroma Lux\" są wykonane z naturalnego wosku sojowego, który gwarantuje czystsze spalanie i dłuższy czas palenia. Idealne jako element dekoracyjny, który wprowadza przyjemną aurę do Twojego domu, oraz jako wyjątkowy prezent dla bliskich.</p>\r\n<div></div>', 'swieca-zapachowa-aroma-lux-vanilla-dream', '', '', '', 'Świeca Zapachowa \"Aroma Lux\" - Vanilla Dream', '', '', '', '', NULL),
