(252, 1, 1, '', '<p>Odkryj magiczny świat zapachów z naszą kolekcją świec \"Aroma Lux\". Każda świeca została stworzona z myślą o zapewnieniu relaksującej atmosfery i dodaniu elegancji każdemu wnętrzu. Wybierz jeden z czterech dostępnych wariantów, aby stworzyć idealne otoczenie dla swoich codziennych i wyjątkowych chwil.</p>\r\n<p>Dostępne warianty:</p>\r\n<ol>\r\n<li>Lavender Bliss - Spokój i relaks z delikatnym zapachem lawendy, idealny na wieczorne odprężenie.</li>\r\n<li>Vanilla Dream - Słodki i ciepły zapach wanilii, który wnosi poczucie komfortu do każdego pomieszczenia.</li>\r\n<li>Citrus Burst - Orzeźwiający i energetyzujący zapach cytrusów, doskonały na pobudzenie zmysłów.</li>\r\n<li>Cedarwood Calm - Głęboki i ziemisty aromat cedru, idealny do stworzenia spokojnej i harmonijnej atmosfery.</li>\r\n</ol>\r\n<p>Specyfikacja:</p>\r\n<ul>\r\n<li>Materiał: Naturalny wosk sojowy</li>\r\n<li>Rozmiar: 150 g</li>\r\n<li>Czas palenia: Do 40 godzin</li>\r\n<li>Pielęgnacja: Przycinaj knot przed każdym użyciem, aby zoptymalizować czas palenia</li>\r\n</ul>\r\n<p>Nasze świece \"Aroma Lux\" są wykonane z naturalnego wosku sojowego, który gwarantuje czystsze spalanie i dłuższy czas palenia. Idealne jako element dekoracyjny, który wprowadza przyjemną aurę do Twojego domu, oraz jako wyjątkowy prezent dla bliskich.</p>\r\n<div></div>', 'swieca-zapachowa-aroma-lux-cedarwood-calm', '', '', '', 'Świeca Zapachowa \"Aroma Lux\" - Cedarwood Calm', '', '', '', '', NULL),
(253, 1, 1, '', '<p>Worek bokserski to niezbędny sprzęt dla każdego pasjonata sportów walki, który pragnie doskonalić swoje umiejętności i poprawić kondycję fizyczną. Nasz worek bokserski oferuje nie tylko wysoką jakość wykonania, ale również różne opcje wagowe, aby dostosować się do indywidualnych potrzeb użytkownika.</p>\r\n<ul>\r\n<li><span>Typ:</span> Worek bokserski</li>\r\n<li><span>Materiał:</span> Solidna, wytrzymała skóra syntetyczna, zapewniająca trwałość i odporność na intensywne treningi</li>\r\n<li><span>Waga:</span> Dostępny w różnych opcjach wagowych, umożliwiających wybór odpowiedniego obciążenia dla treningu</li>\r\n<li><span>Wypełnienie:</span> Elastyczne materiały, które absorbują wstrząsy i zapewniają realistyczne odczucia podczas uderzeń</li>\r\n<li><span>Kolor:</span> Klasyczny czarny lub inny wybrany kolor</li>\r\n<li><span>Wymiary:</span> Standardowe wymiary, zapewniające odpowiednią powierzchnię do treningu techniki uderzeń</li>\r\n<li><span>Zastosowanie:</span> Doskonały zarówno do treningu w domu, jak i w klubie sportowym, idealny dla początkujących oraz zaawansowanych zawodników</li>\r\n<li><span>Dodatkowe cechy:</span>\r\n<ul>\r\n<li>Solidne szwy i wytrzymałe mocowania, zapewniające długotrwałą użyteczność</li>\r\n<li>Odpinany łańcuch lub pętla do zawieszenia, ułatwiający montaż i demontaż</li>\r\n<li>Wzmocnione miejsca, które chronią worek przed uszkodzeniami spowodowanymi intensywnymi treningami</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>Worek bokserski to niezastąpiony element każdego profesjonalnego treningu, który pozwala doskonalić technikę i poprawić kondycję fizyczną. Dzięki naszemu worekowi bokserskiemu możesz w pełni wykorzystać swój potencjał i osiągnąć najlepsze wyniki na ringu!</p>', 'worek-bokserski', '', '', '', 'Worek bokserski', '', '', '', '', NULL),
(254, 1, 1, '', '<p>Przywróć naturę do swojego domu z naszym wazonem \"Wooden Grace\". Ten unikalny wazon, wykonany z naturalnie wyglądającego jasnego drewna, dodaje ciepła i stylu każdej przestrzeni. Jego prosty, ale elegancki design sprawia, że jest idealny do wyeksponowania mniejszych roślin, takich jak sukulenty czy małe rośliny doniczkowe.</p>\r\n<p><span>Specyfikacje:</span></p>\r\n<ul>\r\n<li><span>Materiał:</span> Drewno naturalne</li>\r\n<li><span>Wysokość:</span> 25 cm</li>\r\n<li><span>Kolor:</span> Jasne drewno</li>\r\n<li><span>Zastosowanie:</span> Idealny do mniejszych roślin i jako dekoracyjny element w salonach, biurach lub na balkonach.</li>\r\n</ul>', 'zestaw-wazonow-wooden-grace', '', '', '', 'Zestaw Wazonów \"Wooden Grace\"', '', '', '', '', NULL),
(255, 1, 1, '', '<p>Poczuj magię domowego spa z naszym zestawem \"Spa at Home\", który łączy w sobie elegancję i funkcjonalność, idealne do stworzenia relaksującej atmosfery w zaciszu własnego domu. Zestaw zawiera ultra miękkie, bawełniane ręczniki, luksusową świecę zapachową z drewnianym knotem oraz naturalną szczoteczkę do ciała. To idealny wybór dla każdego, kto ceni sobie chwile odprężenia i dbałość o swoje samopoczucie.</p>\r\n<p><span>Skład zestawu:</span></p>\r\n<ol>\r\n<li><span>Ręczniki</span>: Trzy miękkie, białe ręczniki wykonane z wysokiej jakości bawełny, zapewniające komfort i delikatność dla skóry.</li>\r\n<li><span>Świeca zapachowa \"Rosemary &amp; Linen\"</span>: Elegancko zaprojektowana, sojowa świeca z drewnianym knotem, który delikatnie trzaska, imitując dźwięk palonego drewna. Zapach rozmarynu i lnianej tkaniny wypełni pomieszczenie odprężającym aromatem.</li>\r\n<li><span>Szczoteczka do ciała</span>: Wykonana z naturalnego drewna i sztywnych włosów, idealna do masażu i eksfoliacji, pobudzająca krążenie i wspomagająca odnowę skóry.</li>\r\n</ol>\r\n<p><span>Idealne zastosowanie:</span></p>\r\n<ul>\r\n<li>Domowe spa i sesje pielęgnacyjne</li>\r\n<li>Prezent dla bliskiej osoby ceniącej relaks i odprężenie</li>\r\n<li>Dodatek do łazienki, który łączy styl i funkcjonalność</li>\r\n</ul>\r\n<p>Dzięki temu zestawowi każda łazienka zamieni się w oazę spokoju, a codzienna pielęgnacja stanie się prawdziwą przyjemnością. Stwórz swoje własne, luksusowe spa w domowym zaciszu z zestawem \"Spa at Home\".</p>', 'zestaw-relaksacyjny-spa-at-home-', '', '', '', 'Zestaw Relaksacyjny \"Spa at Home\"', '', '', '', '', NULL),
(256, 1, 1, '', '<p><span>Nowoczesne Smartfony \"Tech Duo\" - Elegancja i Innowacyjność w Jednym</span></p>\r\n<p>Poznaj \"Tech Duo\", dwa wyjątkowe smartfony, które łączą nowoczesne technologie i elegancki design, dostosowany do potrzeb nowoczesnego użytkownika. Oba modele charakteryzują się minimalistyczną estetyką, zaawansowanymi aparatami i wysoką wydajnością.</p>\r\n<p><span>1. Smartfon Pro</span></p>\r\n<ul>\r\n<li><span>Materiał</span>: Szkło hartowane z metalową ramą</li>\r\n<li><span>Kolor</span>: Czarny</li>\r\n<li><span>Specyfikacja kamery</span>: Potrójny system aparatów dla wyjątkowej jakości zdjęć i filmów</li>\r\n<li><span>Cechy</span>: Składany design, umożliwiający łatwe przechowywanie i transport</li>\r\n<li><span>Idealny dla</span>: Entuzjastów fotografii, profesjonalistów oraz osób poszukujących zaawansowanego urządzenia mobilnego</li>\r\n</ul>\r\n<p><span>2. Smartfon Lite</span></p>\r\n<ul>\r\n<li><span>Materiał</span>: Metalowa obudowa</li>\r\n<li><span>Kolor</span>: Srebrny</li>\r\n<li><span>Specyfikacja kamery</span>: Podwójny system aparatów zapewniający doskonałą jakość zdjęć</li>\r\n<li><span>Cechy</span>: Ultracienki design, zapewniający lekkość i komfort użytkowania</li>\r\n<li><span>Idealny dla</span>: Codziennego użytku, osób ceniących sobie prostotę i funkcjonalność</li>\r\n</ul>\r\n<p>Oba modele z serii \"Tech Duo\" oferują nie tylko znakomitą jakość wykonania, ale także wyjątkową wydajność, dzięki czemu idealnie nadają się zarówno do pracy, jak i rozrywki. Bez względu na to, czy potrzebujesz urządzenia do profesjonalnych zastosowań, czy prostego, ale wydajnego smartfona na co dzień, \"Tech Duo\" dostarcza rozwiązań spełniających najwyższe standardy nowoczesności.</p>', 'nowoczesne-smartfony-tech-duo-', '', '', '', 'Nowoczesne Smartfony \"Tech Duo\"', '', '', '', '', NULL),
(257, 1, 1, '', '<p>Zanurz się w świecie doskonałego dźwięku z naszymi bezprzewodowymi słuchawkami dousznymi \"ClearSound\". Te stylowe, ultra lekkie słuchawki zostały zaprojektowane z myślą o maksymalnym komforcie i wygodzie użytkowania, łącząc najnowsze technologie dźwiękowe z eleganckim designem.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Typ</span>: Douszne, bezprzewodowe</li>\r\n<li><span>Kolor</span>: Biały</li>\r\n<li><span>Łączność</span>: Bluetooth 5.0 z szybkim parowaniem</li>\r\n<li><span>Czas pracy</span>: Do 5 godzin słuchania muzyki na jednym ładowaniu, z dodatkowymi 24 godzinami dzięki etui ładującemu</li>\r\n<li><span>Funkcje dodatkowe</span>: Redukcja szumów otoczenia, wbudowany mikrofon do rozmów, sterowanie dotykowe</li>\r\n<li><span>Wodoodporność</span>: IPX4 – odporność na pot i zachlapania</li>\r\n<li><span>Zawartość zestawu</span>: Słuchawki, etui ładujące, kabel USB-C, zestaw gumowych nakładek w różnych rozmiarach</li>\r\n</ul>\r\n<p>Idealne dla miłośników muzyki, którzy są w ciągłym ruchu, \"ClearSound\" zapewnia nie tylko wyjątkową jakość dźwięku, ale także wygodę dzięki bezprzewodowej wolności. Ciesz się ulubionymi utworami, podcastami czy rozmowami bez zbędnych kabli i ograniczeń.</p>', 'bezprzewodowe-sluchawki-douszne-clearsound', '', '', '', 'Bezprzewodowe Słuchawki Douszne \"ClearSound\"', '', '', '', '', NULL),
(258, 1, 1, '', '<p>Odkryj nową jakość użytkowania z naszym flagowym modelem \"Ultra View\". Smartfon ten wyznacza nowe standardy w dziedzinie wyświetlaczy mobilnych, oferując bezramkowy ekran, który zapewnia niesamowite doświadczenia wizualne bez zakłóceń. Dzięki zaawansowanej technologii OLED, kolory są intensywne, a czernie głębokie, co czyni każdy obraz wyjątkowo realistycznym.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Ekran</span>: Duży, elastyczny wyświetlacz OLED</li>\r\n<li><span>Rozmiar ekranu</span>: 7.6 cala, gdy jest rozłożony</li>\r\n<li><span>Rozdzielczość</span>: 1768 x 2208 pikseli</li>\r\n<li><span>Procesor</span>: Najnowszy procesor ośmiordzeniowy</li>\r\n<li><span>Pamięć RAM</span>: 12 GB</li>\r\n<li><span>Pamięć wewnętrzna</span>: 256 GB</li>\r\n<li><span>Aparat</span>: Czterokrotny system kamer z głównym sensorem 108 MP</li>\r\n<li><span>System operacyjny</span>: Android z najnowszymi aktualizacjami</li>\r\n<li><span>Bateria</span>: Długo utrzymująca się bateria o pojemności 4500 mAh</li>\r\n</ul>\r\n<p>\"Ultra View\" to więcej niż smartfon – to centrum rozrywki i efektywności, które mieści się w Twojej dłoni. Idealnie sprawdzi się zarówno podczas pracy, jak i w trakcie oglądania filmów czy grania w najnowsze gry dzięki płynnej pracy systemu i imponującej jakości grafiki. Ciesz się najnowszą technologią, która dostosowuje się do Twojego dynamicznego życia.</p>', 'smartfon-ultra-view', '', '', '', 'Smartfon \"Ultra View\"', '', '', '', '', NULL),
(259, 1, 1, '', '<p>Zanurz się w świat relaksu z naszym zestawem \"Scent Harmony\", który łączy w sobie naturalne aromaty i subtelną prezencję. Ten zestaw to idealny sposób na wprowadzenie spokoju do Twojego domu lub biura.</p>\r\n<p><span>Dyfuzor zapachowy \"Calm Essence\"</span></p>\r\n<ul>\r\n<li><span>Materiał</span>: Szklany pojemnik z drewnianą nakrętką</li>\r\n<li><span>Wymiary</span>: 10 cm wysokości</li>\r\n<li><span>Zawartość</span>: Dyfuzor wypełniony wysokiej jakości olejkiem eterycznym</li>\r\n<li><span>Zalety</span>: Nie wymaga użycia prądu ani baterii, naturalnie rozprowadza zapach w pomieszczeniu</li>\r\n<li><span>Idealne dla</span>: Sypialni, salonów, łazienek lub jako element dekoracyjny w biurze</li>\r\n</ul>\r\n<p><span>Świece zapachowe \"Natural Glow\"</span></p>\r\n<ul>\r\n<li><span>Materiały</span>: Naturalny wosk sojowy</li>\r\n<li><span>Wymiary</span>: Jedna świeca o wysokości 15 cm, druga 12 cm</li>\r\n<li><span>Zapach</span>: Subtelny i uspokajający</li>\r\n<li><span>Czas palenia</span>: Około 50 godzin dla większej świecy, 40 godzin dla mniejszej</li>\r\n<li><span>Zastosowanie</span>: Doskonałe do tworzenia atmosfery relaksu i spokoju</li>\r\n</ul>\r\n<p>Zestaw \"Scent Harmony\" nie tylko pięknie prezentuje się jako element dekoracyjny, ale także funkcjonuje jako skuteczny sposób na redukcję stresu i poprawę nastroju dzięki terapeutycznym właściwościom aromatów. Idealny jako prezent dla bliskiej osoby lub jako dodatek do własnego domowego spa.</p>', 'zestaw-aromaterapeutyczny-scent-harmony', '', '', '', 'Zestaw Aromaterapeutyczny \"Scent Harmony\"', '', '', '', '', NULL);
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`, `my_extra_field_description`) VALUES
(260, 1, 1, '', '<p>\"Wazon Modern Edge\" to połączenie nowoczesnej estetyki z funkcjonalnością. Wykonany z ciemnego drewna, jego geometryczny design przyciąga wzrok i stanowi doskonałą dekorację na każdą okazję. Jest szczególnie odpowiedni do wyeksponowania większych roślin, takich jak monsterki czy filodendrony, które dodadzą życia każdemu wnętrzu.</p>\r\n<p><span>Specyfikacje:</span></p>\r\n<ul>\r\n<li><span>Materiał:</span> Drewno ciemne</li>\r\n<li><span>Wysokość:</span> 30 cm</li>\r\n<li><span>Kolor:</span> Ciemne drewno</li>\r\n<li><span>Zastosowanie:</span> Idealny dla żywych roślin i jako centralny punkt dekoracyjny w każdym pomieszczeniu.</li>\r\n</ul>', 'wazon-modern-edge', '', '', '', 'Wazon \"Modern Edge\"', '', '', '', '', NULL),
(261, 1, 1, '', '<p>PlayStation 5 rewolucjonizuje świat gier dzięki swojej potężnej wydajności i nowoczesnej architekturze. Wyposażona w ultraszybki dysk SSD i zintegrowany system dźwięku 3D, ta konsola gwarantuje niezrównane doświadczenia w grach. Jej elegancki, futurystyczny design pasuje do każdego wnętrza, a ulepszony kontroler DualSense oferuje niezwykłą precyzję sterowania i niespotykane wcześniej doznania sensoryczne.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Procesor</span>: AMD Zen 2, 8 rdzeni o częstotliwości 3,5 GHz</li>\r\n<li><span>Grafika</span>: Custom RDNA 2 od AMD</li>\r\n<li><span>Pamięć</span>: 16 GB GDDR6</li>\r\n<li><span>Przechowywanie</span>: 825 GB SSD</li>\r\n<li><span>Obsługiwane media</span>: Gry na dyskach Ultra HD Blu-ray</li>\r\n</ul>\r\n<p>PlayStation 5 to nie tylko konsola do gier, ale centrum rozrywki domowej z dostępem do streamingowych serwisów filmowych, muzyki i innych form cyfrowej rozrywki.</p>\r\n<div></div>', 'playstation-5-nowa-era-rozrywki-domowej', '', '', '', 'PlayStation 5 - Nowa Era Rozrywki Domowej', '', '', '', '', NULL),
(262, 1, 1, '', '<p>Odkryj doskonałe brzmienie z naszymi słuchawkami nausznymi \"Wooden Harmony\". Te eleganckie słuchawki łączą nowoczesne technologie audio z naturalnymi akcentami drewna, co nadaje im unikalny charakter oraz doskonałą jakość dźwięku.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Typ</span>: Nauszne, zamknięte</li>\r\n<li><span>Materiał</span>: Wytrzymała plastikowa obudowa z elementami drewna</li>\r\n<li><span>Łączność</span>: Przewodowe, z uniwersalnym 3,5 mm jackiem</li>\r\n<li><span>Cechy dźwięku</span>: Wysoka jakość dźwięku z głębokim basem i czystymi wysokimi tonami</li>\r\n<li><span>Dodatkowe funkcje</span>: Regulowany pałąk, miękkie poduszki nauszne zapewniające komfort nawet podczas długiego noszenia</li>\r\n</ul>\r\n<p>\"Woden Harmony\" idealnie nadaje się dla miłośników muzyki ceniących sobie zarówno estetykę, jak i jakość. Stylowe wykończenie drewnem nie tylko wygląda świetnie, ale również poprawia akustykę, zapewniając bogate i pełne brzmienie.</p>', 'sluchawki-nauszne-wooden-harmony-', '', '', '', 'Słuchawki Nauszne \"Wooden Harmony\"', '', '', '', '', NULL),
(263, 1, 1, '', '<p>\"Sky Explorer\" to zaawansowany technologicznie dron, idealny dla profesjonalistów i entuzjastów fotografii lotniczej. Zestaw zawiera wszystko, co potrzebne do rozpoczęcia przygody z dronami, w tym osłony śmigieł, baterie dodatkowe, pilot zdalnego sterowania oraz wygodne etui do transportu.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Model</span>: Kompaktowy, składany design dla łatwej przenośności</li>\r\n<li><span>Kamera</span>: 4K UHD z gimbal stabilizującym na 3 osie</li>\r\n<li><span>Zasięg lotu</span>: Do 10 km</li>\r\n<li><span>Czas lotu</span>: Do 30 minut na jednym ładowaniu</li>\r\n<li><span>Kontroler</span>: Pilot zdalnego sterowania z możliwością podłączenia smartfona</li>\r\n<li><span>Funkcje dodatkowe</span>: Automatyczne unikanie przeszkód, tryb śledzenia, lot powrotny</li>\r\n</ul>\r\n<p>\"Sky Explorer\" jest wyposażony w zaawansowane funkcje, które umożliwiają łatwe i bezpieczne sterowanie, nawet dla początkujących użytkowników. Idealny dla każdego, kto chce uchwycić spektakularne ujęcia z powietrza czy eksplorować świat z nowej perspektywy.</p>', 'profesjonalny-dron-sky-explorer-', '', '', '', 'Profesjonalny Dron \"Sky Explorer\"', '', '', '', '', NULL),
(264, 1, 1, '', '<p>Smartwatch \"TimeKeeper\" to zegarek, który łączy nowoczesne technologie z eleganckim stylem, idealny dla aktywnych i wymagających użytkowników. Dzięki jasnemu, czytelnemu wyświetlaczowi, który pokazuje czas w stylu cyfrowym, ten zegarek oferuje nie tylko podstawowe funkcje takie jak wyświetlanie czasu, ale także monitoring aktywności fizycznej, powiadomienia z telefonu i niestandardowe tarcze zegarka. Jego minimalistyczny design pasuje do każdego stroju, zarówno sportowego, jak i eleganckiego.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Wyświetlacz</span>: Cyfrowy, dotykowy</li>\r\n<li><span>Funkcje</span>: Monitorowanie tętna, krokomierz, powiadomienia o połączeniach i wiadomościach</li>\r\n<li><span>Wodoodporność</span>: Tak</li>\r\n<li><span>Kompatybilność</span>: iOS i Android</li>\r\n<li><span>Bateria</span>: Długi czas działania na jednym ładowaniu</li>\r\n</ul>', 'smartwatch-timekeeper', '', '', '', 'Smartwatch \"TimeKeeper\"', '', '', '', '', NULL),
(265, 1, 1, '', '<p>MacBook Air jest synonimem mobilności i wydajności. Ten ultralekki laptop od Apple jest idealny dla profesjonalistów, studentów i wszystkich, którzy potrzebują niezawodnego i stylowego narzędzia do pracy i rozrywki. Dzięki najnowszemu procesorowi Apple M1, MacBook Air oferuje niesamowitą wydajność i długotrwałą baterię, pozwalając na cały dzień pracy bez konieczności ładowania.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Procesor</span>: Apple M1</li>\r\n<li><span>Wyświetlacz</span>: 13,3-calowy Retina Display</li>\r\n<li><span>Pamięć RAM</span>: 8 GB</li>\r\n<li><span>Przechowywanie</span>: Dostępne warianty od 256 GB do 2 TB SSD</li>\r\n<li><span>Bateria</span>: Do 18 godzin pracy</li>\r\n</ul>\r\n<p>MacBook Air jest idealnym wyborem dla tych, którzy cenią sobie wydajność, długotrwałą baterię i lekkość, co czyni go doskonałym laptopem do podróży, pracy czy nauki.</p>', 'macbook-air-mobilnosc-i-wydajnosc-w-eleganckiej-formie', '', '', '', 'MacBook Air - Mobilność i Wydajność w Eleganckiej Formie', '', '', '', '', NULL),
(266, 1, 1, '', '<h3></h3>\r\n<p>Przygotuj się do intensywnych treningów w wygodzie własnego domu dzięki naszemu zestawowi hantli żeliwnych. Ten kompletny zestaw zawiera hantle o różnych wagach, zapewniając możliwość zróżnicowanego treningu dla wszystkich poziomów sprawności fizycznej. Każda hantla wykonana jest z solidnego żeliwa, co gwarantuje trwałość i niezawodność nawet przy intensywnym użytkowaniu.<br /><br />Zestaw obejmuje hantle o różnych wagach, co umożliwia dostosowanie intensywności treningu do indywidualnych potrzeb i celów. Dzięki różnym wagom hantli, możesz łatwo zwiększać obciążenie i stopniowo rozwijać swoją siłę i wytrzymałość.<br /><br /><span>Solidna konstrukcja:</span> Wykonane z wysokiej jakości żeliwa, nasze hantle są nie tylko trwałe, ale także odporne na uszkodzenia i odkształcenia. Solidna konstrukcja gwarantuje, że hantle będą służyć przez wiele lat, bez względu na intensywność treningów.</p>\r\n<p>Zestaw hantli żeliwnych to niezbędny element każdej domowej siłowni, który pomoże Ci osiągnąć swoje cele fitness. Gotowy do wzmocnienia swojego ciała i poprawy kondycji fizycznej?</p>', 'zestaw-hantli-zeliwnych', '', '', '', 'Zestaw hantli żeliwnych', '', '', '', '', NULL),
(267, 1, 1, '', '<p>Ładowarka USB \"QuickCharge\" jest idealnym rozwiązaniem dla tych, którzy potrzebują szybkiego i niezawodnego sposobu na naładowanie swoich urządzeń. Dzięki kompaktowej, ale mocnej konstrukcji, ta ładowarka jest idealna do użytku zarówno w domu, jak i w podróży. Oferuje szybkie ładowanie z maksymalną efektywnością, zmniejszając czas potrzebny do naładowania smartfonów, tabletów czy innych urządzeń USB.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Wejście</span>: 100-240 V</li>\r\n<li><span>Wyjście</span>: USB-A</li>\r\n<li><span>Prąd wyjściowy</span>: Do 2A</li>\r\n<li><span>Zgodność</span>: Uniwersalna, dla wszystkich urządzeń zasilanych przez USB</li>\r\n</ul>', 'ladowarka-usb-quickcharge', '', '', '', 'Ładowarka USB \"QuickCharge\"', '', '', '', '', NULL),
(268, 1, 1, '', '<p>Rozwijaj swoją praktykę jogi z naszą profesjonalną matą do jogi! Idealna zarówno dla początkujących, jak i zaawansowanych joginów, ta mata zapewnia niezbędne wsparcie i stabilność podczas różnorodnych pozycji i ćwiczeń.</p>\r\n<p><span>Cechy produktu:</span></p>\r\n<ul>\r\n<li><span>Antypoślizgowa powierzchnia:</span> Zapewnia doskonałą przyczepność, co pozwala na bezpieczne wykonanie każdego ruchu bez ryzyka poślizgnięcia.</li>\r\n<li><span>Wygoda i ochrona:</span> Gruba i miękka konstrukcja amortyzuje ciało, chroniąc stawy przed twardą podłogą.</li>\r\n<li><span>Trwały materiał:</span> Wysokiej jakości materiały są odporne na ścieranie i łatwe do czyszczenia.</li>\r\n<li><span>Łatwa do przenoszenia:</span> Mata jest lekka i łatwa do zrolowania, co umożliwia łatwe przechowywanie oraz transport.</li>\r\n</ul>\r\n<p>Nasza mata do jogi jest dostępna w przyciągających wzrok, żywych kolorach, które dodadzą energii każdej sesji jogi lub fitness. Niezależnie od tego, czy ćwiczysz w domu, na zewnątrz czy w studio, nasza mata będzie twoim niezawodnym partnerem. Zamów już dziś i zacznij swoją praktykę z nowym komfortem!</p>', 'mata-do-jogi-i-cwiczen-fitness', '', '', '', 'Mata do Jogi i Ćwiczeń Fitness', '', '', '', '', NULL),
(269, 1, 1, '', '<p>Czy szukasz skutecznego narzędzia do poprawy swojej kondycji i szybkości? Nasza skakanka fitness jest idealnym wyborem dla sportowców, entuzjastów fitness oraz każdego, kto chce podnieść swoją aktywność fizyczną na nowy poziom!</p>\r\n<p><span>Cechy produktu:</span></p>\r\n<ul>\r\n<li><span>Regulowana długość:</span> Pasuje dla osób o różnym wzroście, maksymalizując efektywność treningu i komfort użytkowania.</li>\r\n<li><span>Ergonomiczne rączki:</span> Wyściełane, antypoślizgowe uchwyty zapewniają komfort i stabilność nawet podczas najintensywniejszych sesji.</li>\r\n<li><span>Wytrzymała konstrukcja:</span> Wykonana z trwałych materiałów, zapewnia długą żywotność i odporność na zużycie.</li>\r\n<li><span>Wszechstronne zastosowanie:</span> Idealna do treningów cardio, crossfitu, MMA, boksowania oraz treningów wytrzymałościowych.</li>\r\n</ul>\r\n<p>Nie przegap okazji, aby wzmocnić swoje ciało i zwiększyć sprawność – zamów już dziś naszą profesjonalną skakankę i zacznij osiągać swoje cele fitness!</p>', 'skakanka-fitness-z-regulacja-dlugosci', '', '', '', 'Skakanka Fitness z Regulacją Długości', '', '', '', '', NULL),
(270, 1, 1, '', '<p>Przeznaczona zarówno dla profesjonalistów, jak i amatorów, nasza piłka baseballowa to kluczowy element każdej gry. Wykonana z najlepszych materiałów, zapewnia doskonałą trwałość i wydajność na boisku.</p>\r\n<p><span>Cechy produktu:</span></p>\r\n<ul>\r\n<li><span>Wysokiej jakości skóra:</span> Oferuje doskonałą przyczepność i komfort podczas rzucania i łapania.</li>\r\n<li><span>Wytrzymałe szwy:</span> Czerwone, podwójnie szyte szwy nie tylko dodają estetyki, ale także gwarantują długotrwałość i odporność na intensywne uderzenia.</li>\r\n<li><span>Regulacja wagi i rozmiaru:</span> Zgodność ze standardami ligowymi, idealna do treningów i oficjalnych meczów.</li>\r\n<li><span>Optymalne odbicie:</span> Projektowana tak, aby zapewniać konsystentne odbicie i precyzję podczas gry.</li>\r\n</ul>\r\n<p>Idealna dla szkół, klubów sportowych i entuzjastów baseballa, nasza piłka to wybór, który zwiększy poziom każdej gry. Zainwestuj w profesjonalny sprzęt i ciesz się lepszymi wynikami już dziś!</p>', 'pilka-baseballowa-przeznaczona-dla-mistrzow', '', '', '', 'Piłka Baseballowa – Przeznaczona dla Mistrzów!', '', '', '', '', NULL),
(271, 1, 1, '', '<p>Piłka gimnastyczna \"Core Balance\" to niezastąpione narzędzie w każdym domowym zestawie do ćwiczeń. Doskonale nadaje się do różnorodnych aktywności, w tym do jogi, pilates, ćwiczeń rehabilitacyjnych oraz treningów siłowych i rozciągających. Jest także często używana jako alternatywne siedzisko, które pomaga w utrzymaniu prawidłowej postawy i wzmacnia mięśnie brzucha oraz pleców podczas siedzenia.</p>\r\n<p><span>Specyfikacja:</span></p>\r\n<ul>\r\n<li><span>Średnica</span>: 65 cm – idealna dla osób o wzroście od 165 cm do 185 cm</li>\r\n<li><span>Materiał</span>: Wytrzymały, antypoślizgowy PVC, który jest odporny na przetarcia i pęknięcia</li>\r\n<li><span>Maksymalne obciążenie</span>: Do 300 kg, co pozwala na wykorzystanie piłki przez osoby o różnym ciężarze</li>\r\n<li><span>Pompa</span>: Dołączona pompka umożliwia szybkie i łatwe napompowanie</li>\r\n<li><span>Kolor</span>: Szary – neutralny kolor, który dobrze komponuje się z większością wnętrz</li>\r\n</ul>\r\n<p><span>Zastosowanie i korzyści:</span></p>\r\n<ul>\r\n<li><span>Ćwiczenia równowagi i koordynacji</span>: Idealna do treningów, które poprawiają równowagę i koordynację ciała.</li>\r\n<li><span>Treningi siłowe</span>: Można używać do ćwiczeń takich jak brzuszki, przysiady czy pomosty, co wzmacnia i tonizuje różne grupy mięśniowe.</li>\r\n<li><span>Ćwiczenia rozciągające</span>: Pomaga w łagodzeniu napięć mięśniowych i zwiększa elastyczność.</li>\r\n<li><span>Rehabilitacja</span>: Często stosowana w rehabilitacji kręgosłupa i innych dolegliwości.</li>\r\n</ul>\r\n<p>Piłka \"Core Balance\" to wszechstronny sprzęt, który pomaga w poprawie ogólnego stanu zdrowia i fitnessu, dostarczając efektywnego i bezpiecznego treningu dla użytkowników na każdym poziomie zaawansowania.</p>', 'pilka-do-cwiczen-core-balance', '', '', '', 'Piłka do ćwiczeń \"Core Balance\"', '', '', '', '', NULL),
(272, 1, 1, '', '<span>Kolorowe hantle neoprenowe, każdy ważący 2 kg. Idealne dla początkujących i zaawansowanych użytkowników, do użytku w domu lub w siłowni dla zwiększenia siły i wytrzymałości.</span>', 'zestaw-hantli-neoprenowych', '', '', '', 'Zestaw hantli neoprenowych', '', '', '', '', NULL),
(273, 1, 1, '', '<p>Nasza piłka nożna to doskonały wybór dla zawodowców i amatorów. Idealna do gry na różnych rodzajach nawierzchni, od boisk trawiastych po sztuczną trawę, zapewnia doskonałą kontrolę i długotrwałą wytrzymałość.</p>\r\n<p><span>Cechy produktu:</span></p>\r\n<ul>\r\n<li><span>Klasyczny design:</span> Czarno-biała kolorystyka to nie tylko ikona stylu, ale również zapewnia dobrą widoczność na boisku.</li>\r\n<li><span>Wysokiej jakości materiały:</span> Wykonana z trwałego materiału, który zapewnia optymalne odbicie i trwałość w różnych warunkach pogodowych.</li>\r\n<li><span>Standardowe rozmiary:</span> Zgodna ze standardami międzynarodowymi, idealna do meczów i treningów.</li>\r\n<li><span>Wszechstronne zastosowanie:</span> Świetnie sprawdza się zarówno w rekreacyjnych, jak i profesjonalnych rozgrywkach.</li>\r\n</ul>\r\n<p>Zainwestuj w naszą piłkę nożną, aby cieszyć się grą na najwyższym poziomie niezależnie od tego, czy grasz na lokalnym boisku, czy na dużym stadionie. Kup już teraz i poczuj różnicę w każdym strzale i podaniu!</p>', 'pilka-nozna-klasyk-na-boisku', '', '', '', 'Piłka Nożna – Klasyk na Boisku!', '', '', '', '', NULL),
(274, 1, 1, '', '<p>Poznaj nasze stylowe i funkcjonalne butelki termiczne, które staną się Twoim niezbędnym towarzyszem zarówno podczas intensywnych treningów, jak i codziennego użytku! Dostępne w atrakcyjnej gamie pastelowych kolorów, te butelki nie tylko świetnie wyglądają, ale też zapewniają utrzymanie temperatury napojów przez wiele godzin.</p>\r\n<p><span>Cechy produktu:</span></p>\r\n<ul>\r\n<li><span>Podwójne ścianki izolacyjne:</span> Technologia ta zapewnia, że Twoje napoje pozostaną gorące przez do 12 godzin lub zimne przez do 24 godzin.</li>\r\n<li><span>Stal nierdzewna o wysokiej jakości:</span> Butelki są wykonane z trwałej stali nierdzewnej, co zapewnia ich długą żywotność i bezpieczeństwo użytkowania.</li>\r\n<li><span>Ergonomiczny design:</span> Prosty, elegancki design i gładka tekstura zapewniają łatwe trzymanie i transport.</li>\r\n<li><span>Ekologiczny wybór:</span> Z naszymi wielorazowymi butelkami termicznymi możesz zmniejszyć swoje ślad ekologiczny, rezygnując z plastikowych butelek jednorazowego użytku.</li>\r\n<li><span>Różne pojemności:</span> Dostępne w różnych rozmiarach, aby sprostać indywidualnym potrzebom.</li>\r\n</ul>\r\n<p>Nie pozwól, aby Twoje napoje straciły swoją temperaturę! Wybierz nasze butelki termiczne, które połączyły funkcjonalność z nowoczesnym designem, czyniąc każdy łyk przyjemnością, niezależnie od miejsca i czasu. Zamów już teraz!</p>', 'butelki-termiczne-w-pastelowych-kolorach', '', '', '', 'Butelki Termiczne w Pastelowych Kolorach', '', '', '', '', NULL),
(275, 1, 1, '', '<span>Witaj w fascynującym świecie szachów, gdzie klasyka spotyka się z nowoczesnym designem. Nasz zestaw szachowy wyróżnia się wyjątkowym wyglądem – figury wykonane są z wysokiej jakości akrylu, który przypomina szkło, ale jest znacznie bardziej trwały i bezpieczny. Czarne figury są głęboko czarne, natomiast białe – krystalicznie przezroczyste, co dodaje elegancji i nowoczesności każdej partii. Każda figura została starannie zaprojektowana, aby zapewnić nie tylko estetyczny wygląd, ale także komfort podczas gry. Szachownica wykonana z solidnego materiału jest trwała i wytrzymała, co gwarantuje długotrwałą przyjemność z gry. Odkryj nowy wymiar klasycznej gry z naszym unikalnym zestawem szachowym, który doda stylu i klasy każdemu wnętrzu.</span>', 'szachy', '', '', '', 'Szachy', '', '', '', '', NULL),
(276, 1, 1, '', '<p>Poczuj magię kreatywnej zabawy z naszym zestawem \"Kolorowe Drewniane Klocki\", który łączy w sobie klasyczny urok i nowoczesny design, idealne do rozwijania wyobraźni i zdolności manualnych Twojego dziecka. Zestaw zawiera różnorodne, kolorowe klocki, wykonane z naturalnego drewna, bezpieczne i przyjazne dla środowiska. To doskonały wybór dla każdego, kto ceni sobie edukacyjne i kreatywne zabawki.</p>\r\n<p>Skład zestawu:</p>\r\n<p>Kolorowe klocki: Zestaw składa się z 50 różnych klocków, w różnych kształtach i żywych kolorach, umożliwiających nieograniczoną zabawę i budowanie. Bezpieczne materiały: Klocki wykonane są z wysokiej jakości, nietoksycznego drewna, starannie oszlifowanego, aby zapewnić bezpieczeństwo podczas zabawy. Estetyczne opakowanie: Całość zapakowana jest w eleganckie, kartonowe pudełko, które ułatwia przechowywanie i jest idealnym pomysłem na prezent. Idealne zastosowanie:</p>\r\n<p>Rozwój wyobraźni i kreatywności: Budowanie różnych struktur i kształtów rozwija zdolności manualne i kreatywne myślenie. Edukacja przez zabawę: Klocki pomagają w nauce kolorów, kształtów i podstawowych zasad konstrukcji. Bezpieczna zabawa: Naturalne, nietoksyczne materiały gwarantują bezpieczną i ekologiczną zabawę dla Twojego dziecka. Dzięki temu zestawowi każde dziecko może stworzyć swoje własne, kolorowe światy, a zabawa klockami stanie się prawdziwą przyjemnością. Stwórz niezapomniane chwile kreatywności i radości z zestawem \"Kolorowe Drewniane Klocki\".</p>', 'kolorowe-drewniane-klocki', '', '', '', 'Kolorowe Drewniane Klocki', '', '', '', '', NULL),
(277, 1, 1, '', '<p>Przeznaczona dla graczy na każdym poziomie zaawansowania, nasza piłka do koszykówki zapewnia wyjątkową kontrolę i jest odporna na intensywne użytkowanie zarówno na parkiecie, jak i na zewnętrznych boiskach.</p>\r\n<p><span>Cechy produktu:</span></p>\r\n<ul>\r\n<li><span>Wykonana z wysokiej jakości skóry syntetycznej:</span> Zapewnia doskonałą przyczepność oraz komfort w trakcie gry, co jest kluczowe dla precyzyjnych rzutów i dryblingu.</li>\r\n<li><span>Trwała konstrukcja:</span> Odporna na ścieranie i pęknięcia, idealna na różnorodne nawierzchnie boiskowe.</li>\r\n<li><span>Standardowe wymiary:</span> Zgodność z międzynarodowymi normami koszykówki, sprawdza się w oficjalnych meczach oraz treningach.</li>\r\n<li><span>Atrakcyjny wygląd:</span> Klasyczny pomarańczowy kolor i widoczne linie, które nie tylko wyglądają estetycznie, ale także pomagają w szybszej orientacji podczas gry.</li>\r\n</ul>\r\n<p>Zainwestuj w naszą piłkę do koszykówki, aby podnieść swoją grę na wyższy poziom. Idealna dla szkół, klubów sportowych i rekreacyjnych graczy, którzy cenią sobie jakość i wydajność. Kup już teraz i zdominuj parkiet!</p>\r\n<div></div>', 'pilka-do-koszykowki-doskonala-kontrola-i-trwalosc', '', '', '', 'Piłka do Koszykówki – Doskonała Kontrola i Trwałość', '', '', '', '', NULL),
(278, 1, 1, '', '<span>Odkryj fenomenalną łamigłówkę, która od dekad fascynuje ludzi na całym świecie - Kostka Rubika! Ta trójwymiarowa kostka składa się z sześciu różnych kolorów, a jej celem jest ułożenie każdej ściany w jednolity kolor. Stworzona przez Ernő Rubika w 1974 roku, Kostka Rubika stała się jedną z najlepiej sprzedających się zabawek na świecie. <br /><br />Ciekawostką jest, że istnieje aż 43 kwadryliony możliwych kombinacji, ale tylko jedno prawidłowe rozwiązanie. Dla zaawansowanych graczy istnieją nawet oficjalne zawody w układaniu kostki na czas, a rekord świata wynosi mniej niż 4 sekundy! Kostka Rubika to doskonały trening dla umysłu, rozwijający zdolności logicznego myślenia, cierpliwość i wytrwałość. Gotowy na wyzwanie?</span>', 'kostka-rubika', '', '', '', 'Kostka Rubika', '', '', '', '', NULL),
(279, 1, 1, '', '<span>Czas na emocje i nieprzewidywalność z Uno – dynamiczną grą karcianą dla całej rodziny! Celem jest pozbycie się kart z ręki poprzez dobieranie kolorów lub numerów. Ale uwaga! Specjalne karty mogą odwrócić losy gry w jednej chwili. Uno to doskonała rozrywka, która testuje refleks, spostrzegawczość i umiejętność podejmowania szybkich decyzji. Gotowy na ekscytującą przygodę? Uno na pewno dostarczy jej w nadmiarze!</span>', 'gra-karciana-uno', '', '', '', 'Gra karciana \"UNO\"', '', '', '', '', NULL),
(280, 1, 1, '', '<span>Wkraczaj do fascynującego świata nieruchomości i biznesu z Monopoly! Ta kultowa gra planszowa przenosi Cię w podróż po ulicach miasta, gdzie Twoim celem jest zdobycie jak największego majątku i dominacja na rynku. Kupuj, sprzedawaj, inwestuj – to tylko niektóre z działań, które podejmiesz, by osiągnąć sukces. Monopoly to nie tylko gra, to także szansa na rozwijanie umiejętności zarządzania finansami, strategii biznesowej i negocjacji. Gotowy stać się magnatem?</span>', 'gra-planszowa-monopoly', '', '', '', 'Gra planszowa \"Monopoly\"', '', '', '', '', NULL),
(281, 1, 1, '', '<p>Odkryj niekończącą się rozrywkę z naszym zestawem kart do gry, który łączy w sobie klasykę i nowoczesność, idealne do tworzenia niezapomnianych chwil zabawy z rodziną i przyjaciółmi. Zestaw zawiera różnorodne karty, wykonane z wysokiej jakości materiałów, zapewniające trwałość i komfort podczas rozgrywki. To doskonały wybór dla każdego, kto ceni sobie czas spędzony z bliskimi i chce uczynić go jeszcze bardziej zabawnym i ekscytującym.</p>\r\n<p>Skład zestawu:</p>\r\n<p>Zestaw standardowy: Składa się z 52 kart plus dwóch jokerów, o wyrazistych wzorach, które dodają uroku i radości do każdej gry. Trwałe materiały: Karty wykonane są z wysokiej jakości papieru, o właściwościach odpornych na zagniecenia i ścieranie, gwarantując niezakłóconą zabawę przez wiele godzin. Uniwersalne zastosowanie: Nadają się do różnych gier karcianych, takich jak Poker, Bridge, Blackjack czy Uno, zapewniając wszechstronną rozrywkę dla wszystkich uczestników. Idealne zastosowanie:</p>\r\n<p>Zabawa w gronie rodziny i przyjaciół: Karty zapewniają doskonałą okazję do wspólnego spędzania czasu i tworzenia niezapomnianych wspomnień. Imprezowe wieczory: Doskonałe rozwiązanie na imprezy i spotkania towarzyskie, które gwarantuje niekończącą się rozrywkę i śmiech. Ćwiczenie umiejętności matematycznych i spostrzegawczości: Gry karciane rozwijają logiczne myślenie, szybkość reakcji i umiejętność analizy sytuacji. Dzięki temu zestawowi każda gra zamieni się w emocjonującą przygodę, a karty dodadzą uroku i radości do każdej rozgrywki. Stwórz niezapomniane chwile zabawy i śmiechu z zestawem kart do gry.</p>', 'zestaw-kart-do-gry-niekonczaca-sie-zabawa', '', '', '', 'Zestaw Kart do Gry: Niekończąca Się Zabawa', '', '', '', '', NULL),
(282, 1, 1, '', '<div class=\"flex flex-grow flex-col max-w-full\">\r\n<div class=\"min-h-[20px] text-message flex flex-col items-start whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 juice:w-full juice:items-end overflow-x-auto gap-2\">\r\n<div class=\"flex w-full flex-col gap-1 juice:empty:hidden juice:first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>Odkryj świat nieograniczonej kreatywności z naszym zestawem \"LEGO Kreatywne Konstrukcje\", który łączy w sobie innowacyjność i tradycję, idealny do tworzenia niezliczonych konstrukcji i rozwijania wyobraźni Twojego dziecka. Zestaw zawiera różnorodne, kolorowe klocki LEGO, które są symbolem jakości i wszechstronności. To perfekcyjny wybór dla każdego, kto ceni sobie edukacyjne i kreatywne zabawki.</p>\r\n<p>Skład zestawu:</p>\r\n<p>Kolorowe klocki LEGO: Zestaw składa się z 500 różnych klocków LEGO, w różnych kształtach i żywych kolorach, umożliwiających budowanie wszelkiego rodzaju struktur i postaci. Bezpieczne materiały: Klocki wykonane są z wysokiej jakości, nietoksycznego plastiku, gwarantującego trwałość i bezpieczeństwo podczas zabawy. Instrukcja budowy: W zestawie znajduje się także ilustrowana instrukcja, pomagająca w tworzeniu różnych projektów oraz inspirująca do własnych pomysłów. Idealne zastosowanie:</p>\r\n<p>Rozwój wyobraźni i kreatywności: Budowanie różnych struktur i postaci rozwija zdolności manualne i kreatywne myślenie. Edukacja przez zabawę: Klocki pomagają w nauce kolorów, kształtów oraz logicznego myślenia i rozwiązywania problemów. Bezpieczna zabawa: Wysokiej jakości, nietoksyczne materiały gwarantują bezpieczną i długotrwałą zabawę dla Twojego dziecka. Dzięki temu zestawowi każde dziecko może stworzyć swoje własne, wyjątkowe światy, a zabawa klockami LEGO stanie się prawdziwą przyjemnością. Stwórz niezapomniane chwile kreatywności i radości z zestawem \"LEGO Kreatywne Konstrukcje\".</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mt-1 flex gap-3 empty:hidden juice:-ml-3\">\r\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\r\n<div class=\"flex items-center\"><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span>\r\n<div class=\"flex\"></div>\r\n<div class=\"flex items-center pb-0.5 juice:pb-0\"></div>\r\n</div>\r\n</div>\r\n</div>', 'kolorowy-swiat-lego', '', '', '', 'Kolorowy Świat LEGO', '', '', '', '', NULL),
(283, 1, 1, '', '<span>Wejdź do świata słów i rywalizacji z grą \"Scrabble\". Ta klasyczna gra słowna pozwala graczom na tworzenie słów z losowo dobranych liter, zdobywając punkty za ich długość i wartość poszczególnych liter. Scrabble to nie tylko świetna zabawa, ale także doskonały sposób na rozwijanie słownictwa i umiejętności językowych. <br /><br />Ciekawostką jest, że pierwsza wersja gry została opracowana przez Alfreda Buttsa w 1938 roku, a obecnie gra jest dostępna w 29 językach i sprzedana w ponad 150 milionach egzemplarzy na całym świecie. Dla prawdziwych fanów Scrabble, istnieją nawet międzynarodowe turnieje i mistrzostwa! Czy jesteś gotów podjąć wyzwanie i sprawdzić swoje umiejętności językowe?</span>', 'gra-slowna-scrabble', '', '', '', 'Gra słowna - Scrabble', '', '', '', '', NULL),
(284, 1, 1, '', '<p>Wprowadź swoje dziecko w świat motoryzacji z naszym zestawem autek dla dzieci 3+. Te kolorowe, wytrzymałe pojazdy zostały zaprojektowane z myślą o najmłodszych, zapewniając bezpieczną i kreatywną zabawę. Wykonane z wysokiej jakości, nietoksycznego plastiku, autka są odporne na upadki i uderzenia, co gwarantuje długotrwałą radość z zabawy. Każdy pojazd ma zaokrąglone krawędzie, aby zapewnić maksymalne bezpieczeństwo podczas zabawy.</p>\r\n<p>zabawa autkami wspomaga rozwój motoryczny, koordynację ręka-oko oraz wyobraźnię dziecka. Dzieci mogą tworzyć własne historie i scenariusze, co dodatkowo stymuluje ich kreatywność i zdolności narracyjne. Zestaw autek to idealny prezent dla każdego małego miłośnika motoryzacji, zapewniający godziny fascynującej zabawy. </p>', 'zestaw-autek-dla-dzieci-3', '', '', '', 'Zestaw autek dla dzieci (3+)', '', '', '', '', NULL),
(285, 1, 1, '', '<span>Elegancka torebka damska wykonana z wysokiej jakości skóry ekologicznej w krokodyli wzór. Bordowy kolor nadaje jej wyjątkowego charakteru, a złote zapięcie dodaje luksusowego wykończenia. Idealna na wieczorne wyjścia i specjalne okazje, gdzie każdy detal ma znaczenie.</span>', 'torebka-bordowa', '', '', '', 'Torebka bordowa', '', '', '', '', NULL),
(286, 1, 1, '', '<span>Wykonany z wysokiej jakości skóry, ten brązowy pleciony pasek to must-have w każdej garderobie. Jego klasyczny design sprawia, że doskonale komponuje się zarówno z casualowymi, jak i bardziej formalnymi stylizacjami. Solidna klamra zapewnia trwałość i komfort noszenia.</span>', 'pleciony-brazowy-pasek', '', '', '', 'Pleciony Brązowy Pasek', '', '', '', '', NULL),
(287, 1, 1, '', '<span>Klasyczne okulary przeciwsłoneczne marki Ray-Ban, model Wayfarer. Czarne oprawki i ciemne soczewki zapewniają nie tylko stylowy wygląd, ale również ochronę przed promieniami UV. Idealne na słoneczne dni, dodające szyku każdej stylizacji.</span>', 'okulary-przeciwsloneczne-ray-ban', '', '', '', 'Okulary Przeciwsłoneczne Ray-Ban', '', '', '', '', NULL),
(288, 1, 1, '', '<p>Elegancki zestaw czterech koszul męskich w różnorodnych odcieniach niebieskiego i białego, zaprojektowanych z myślą o nowoczesnym mężczyźnie ceniącym sobie zarówno styl, jak i wygodę. Każda koszula została wykonana z wysokiej jakości bawełny, która zapewnia komfort noszenia przez cały dzień, a jednocześnie jest łatwa w pielęgnacji.</p>\r\n<h4>Koszula Biała</h4>\r\n<p>Klasyczna biała koszula to podstawa każdej męskiej garderoby. Idealna do formalnych stylizacji, świetnie komponuje się z garniturem, a także może być noszona w bardziej casualowych zestawieniach, np. z chinosami. Delikatny wzór na tkaninie dodaje jej subtelnej elegancji.</p>\r\n<h4>Koszula Jasnoniebieska</h4>\r\n<p>Koszula w jasnoniebieskim kolorze to świetna propozycja na co dzień oraz do biura. Jej stonowany odcień sprawia, że jest uniwersalna i łatwo łączy się z różnymi elementami garderoby. Świetnie wygląda zarówno z krawatem, jak i bez niego, co pozwala na swobodę w tworzeniu stylizacji.</p>\r\n<h4>Koszula w Delikatne Kropki</h4>\r\n<p>Koszula z subtelnym, kropeczkowym wzorem w kolorze niebieskim to idealny wybór dla tych, którzy lubią dodać swoim stylizacjom nieco charakteru. Wzór jest elegancki, ale jednocześnie nie przytłacza, dzięki czemu koszula nadaje się zarówno na mniej formalne spotkania, jak i do pracy.</p>\r\n<h4>Koszula Granatowa w Kropki</h4>\r\n<p>Koszula granatowa w drobne, białe kropki to propozycja dla mężczyzn ceniących sobie wyraziste, ale jednocześnie eleganckie wzory. Granatowy kolor dodaje stylizacji głębi, a wzór w kropki wprowadza element dynamizmu. Doskonała na wieczorne wyjścia, spotkania biznesowe oraz codzienne noszenie.</p>\r\n<p>Każda koszula w zestawie posiada klasyczny kołnierzyk, który sprawdza się zarówno przy noszeniu krawata, jak i bez niego. Mankiety są zapinane na guziki, co pozwala na łatwe dostosowanie ich do indywidualnych potrzeb. Koszule są dostępne w różnych rozmiarach, aby zapewnić idealne dopasowanie do każdej sylwetki.</p>\r\n<p>Zestaw koszul męskich to doskonały wybór dla mężczyzn, którzy chcą mieć pewność, że zawsze wyglądają stylowo i elegancko. To uniwersalne rozwiązanie, które sprawdzi się w wielu sytuacjach – od formalnych spotkań, przez codzienne wyjścia do biura, aż po mniej oficjalne okazje. Dodaj ten zestaw do swojej garderoby i ciesz się komfortem oraz elegancją każdego dnia.</p>', 'koszula-meska-rozne-warianty', '', '', '', 'Koszula męska różne warianty', '', '', '', '', NULL),
(289, 1, 1, '', '<h3></h3>\r\n<p>Poznaj nasze okulary przeciwsłoneczne Aviator \"SkyGlide\", które łączą klasyczny styl z nowoczesną funkcjonalnością. Idealne dla osób ceniących sobie zarówno modę, jak i ochronę oczu.</p>\r\n<ul>\r\n<li><span>Model:</span> Aviator \"SkyGlide\"</li>\r\n<li><span>Kształt:</span> Klasyczne aviatory</li>\r\n<li><span>Kolor oprawek:</span> Srebrny / Złoty / Czarny</li>\r\n<li><span>Materiał oprawek:</span> Wysokiej jakości metal, lekki i trwały</li>\r\n<li><span>Soczewki:</span> Polaryzowane, zapewniające ochronę UV400, która skutecznie chroni przed szkodliwym promieniowaniem UVA i UVB</li>\r\n<li><span>Kolor soczewek:</span> Szary / Zielony / Brązowy</li>\r\n<li><span>Wymiary:</span>\r\n<ul>\r\n<li>Szerokość soczewki: 58 mm</li>\r\n<li>Wysokość soczewki: 50 mm</li>\r\n<li>Szerokość mostka: 14 mm</li>\r\n<li>Długość zauszników: 135 mm</li>\r\n</ul>\r\n</li>\r\n<li><span>Dodatkowe cechy:</span>\r\n<ul>\r\n<li>Regulowane noski dla większego komfortu noszenia</li>\r\n<li>Antyrefleksyjna powłoka na soczewkach</li>\r\n<li>W zestawie: eleganckie etui, ściereczka do czyszczenia oraz woreczek do przechowywania</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>Okulary przeciwsłoneczne Aviator \"SkyGlide\" to idealny wybór na każdą okazję – od codziennych spacerów, przez jazdę samochodem, po letnie wakacje. Ich uniwersalny design pasuje do każdego kształtu twarzy, dodając klasy i elegancji. Wybierz \"SkyGlide\" i ciesz się doskonałą ochroną oczu oraz niezrównanym stylem.</p>', 'okulary-przeciwsloneczne-aviator-skyglide', '', '', '', 'Okulary Przeciwsłoneczne Aviator \"SkyGlide\"', '', '', '', '', NULL),
(290, 1, 1, '', '<p>Odkryj kolekcję skórzanych torebek \"Elegance\", dostępnych w czterech stylowych odcieniach: zielonym, fioletowym, czarnym i brązowym. Każda torebka została starannie wykonana z najwyższej jakości skóry naturalnej, łącząc elegancję i funkcjonalność w jednym.</p>\r\n<ul>\r\n<li><span>Materiał:</span> Skóra naturalna</li>\r\n<li><span>Wymiary:</span> 20 cm (wysokość) x 25 cm (szerokość) x 8 cm (głębokość)</li>\r\n<li><span>Kolory:</span> Przygaszona zieleń, fiolet, czerń i brąz</li>\r\n<li><span>Zapięcie:</span> Zamek błyskawiczny</li>\r\n<li><span>Wnętrze:</span> Jedna główna komora z dodatkową kieszonką na telefon i klucze</li>\r\n<li><span>Rączka:</span> Regulowana, umożliwiająca noszenie torebki na ramieniu lub w ręce</li>\r\n</ul>\r\n<p>Te małe, eleganckie torebki z rączką są idealnym dodatkiem do każdej stylizacji. Dzięki subtelnym kolorom i klasycznemu designowi, doskonale sprawdzą się zarówno na co dzień, jak i na specjalne okazje. Wybierz swój ulubiony kolor lub zainwestuj w cały zestaw, aby zawsze mieć odpowiednią torebkę na każdą okazję.</p>', 'skorzana-torebka-elegance', '', '', '', 'Skórzana Torebka \"Elegance\"', '', '', '', '', NULL),
(291, 1, 1, '', '<p>Okulary przeciwsłoneczne \"Golden Circle\" to połączenie ponadczasowej elegancji z wyjątkowym stylem. Zaprojektowane z myślą o tych, którzy cenią sobie klasyczny wygląd i wysoką jakość, te okrągłe okulary zapewniają nie tylko doskonałą ochronę oczu, ale także dodają niepowtarzalnego uroku każdej stylizacji.</p>\r\n<ul>\r\n<li><span>Model:</span> Golden Circle</li>\r\n<li><span>Kształt:</span> Okrągłe soczewki</li>\r\n<li><span>Kolor oprawek:</span> Złoty</li>\r\n<li><span>Materiał oprawek:</span> Solidna konstrukcja ze stopu metali szlachetnych, gwarantująca trwałość i lekkość noszenia</li>\r\n<li><span>Soczewki:</span> Wysokiej jakości soczewki polaryzacyjne, chroniące przed szkodliwym promieniowaniem UV400</li>\r\n<li><span>Kolor soczewek:</span> Neutralny odcień, który doskonale współgra z każdym zestawem</li>\r\n<li><span>Wymiary:</span>\r\n<ul>\r\n<li>Średnica soczewki: 50 mm</li>\r\n<li>Szerokość mostka: 20 mm</li>\r\n<li>Długość zauszników: 140 mm</li>\r\n</ul>\r\n</li>\r\n<li><span>Dodatkowe cechy:</span>\r\n<ul>\r\n<li>Regulowane noski, zapewniające idealne dopasowanie do kształtu nosa</li>\r\n<li>Minimalistyczny, lecz elegancki design, który pasuje do różnych stylizacji</li>\r\n<li>W zestawie eleganckie etui i ściereczka do czyszczenia, zapewniające odpowiednią pielęgnację i przechowywanie</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>Okulary przeciwsłoneczne \"Golden Circle\" to nie tylko funkcjonalny dodatek, ale także wyraz osobistego stylu i gustu. Wybierz je, by dodać niepowtarzalnego blasku każdej chwili i cieszyć się niezawodną ochroną oczu w każdych warunkach.</p>', 'okulary-przeciwsloneczne-golden-circle-', '', '', '', 'Okulary przeciwsłoneczne \"Golden Circle\"', '', '', '', '', NULL),
(292, 1, 1, '', '<p>Perfumy \"Gabrielle\" stworzone przez Chanel to owoc wieloletnich poszukiwań i inspiracji. Nazwa \"Gabrielle\" odnosi się do prawdziwego imienia założycielki domu mody Chanel, Gabrielle Bonheur Chanel, znanej jako Coco Chanel. To zapach, który wyraża ducha wolności, odwagi i niezależności, charakterystyczny dla kobiety, którą Chanel hołduje.</p>\r\n<p>Oto więcej szczegółów na temat tych wyjątkowych perfum:</p>\r\n<ul>\r\n<li><span>Nazwa:</span> Gabrielle</li>\r\n<li><span>Marka:</span> Chanel</li>\r\n<li><span>Rodzaj zapachu:</span> Kwiatowy</li>\r\n<li><span>Główne nuty zapachowe:</span>\r\n<ul>\r\n<li>Nuta głowy: Neroli, jaśmin, ylang-ylang, kwiat pomarańczy</li>\r\n<li>Nuta serca: jaśmin, ylang-ylang</li>\r\n<li>Nuta bazy: piżmo, sandałowiec, paczula, wanilia</li>\r\n</ul>\r\n</li>\r\n<li><span>Charakter zapachu:</span> Gabrielle to kwiatowy zapach, który emanuje świeżością, delikatnością i elegancją. Jest to kompozycja pełna energii i radości, która podkreśla indywidualność i pewność siebie.</li>\r\n<li><span>Okazja do noszenia:</span> Perfumy Gabrielle są idealne na co dzień, dodając subtelny akcent luksusu i klasy do każdej sytuacji. Mogą być noszone zarówno przez młode, dynamiczne kobiety, jak i przez te o bardziej dojrzałym stylu życia.</li>\r\n<li><span>Opakowanie:</span> Flakon perfum Gabrielle charakteryzuje się prostą, elegancką formą, typową dla estetyki Chanel. Przejrzysty szklany flakon zdobi złoty płatek, nawiązujący do kwiatu.</li>\r\n<li><span>Popularność:</span> Perfumy Gabrielle od Chanel zdobyły uznanie zarówno w świecie perfumeryjnym, jak i wśród miłośników marki Chanel, ceniących jej niepowtarzalny styl i klasykę.</li>\r\n</ul>\r\n<p>Gabrielle od Chanel to nie tylko zapach, ale także manifestacja osobowości i stylu. Jest to perfumy dla kobiet, które śmiało wyrażają swoją indywidualność i niezależność, inspirując innych swoją pewnością siebie i determinacją.</p>', 'perfumy-gabrielle-by-chanel', '', '', '', 'Perfumy \"Gabrielle\" by Chanel', '', '', '', '', NULL),
(293, 1, 1, '', '<p>Nasze rękawice bokserskie to doskonały wybór dla wszystkich pasjonatów sportów walki, którzy szukają wysokiej jakości i stylowego designu. Dostępne w kolorach czerwonym i niebieskim oraz w różnych rozmiarach od S do XL, nasze rękawice zapewniają idealne dopasowanie i ochronę podczas każdego treningu lub walki.</p>\r\n<ul>\r\n<li><span>Kolor:</span> Czerwony / Niebieski</li>\r\n<li><span>Rozmiary:</span> S / M / L / XL</li>\r\n<li><span>Materiał:</span> Wytrzymała skóra syntetyczna, zapewniająca trwałość i elastyczność podczas treningu</li>\r\n<li><span>Wyściółka:</span> Miękka wyściółka z pianki lub gąbki, która absorbuje wstrząsy i zapewnia komfort użytkowania</li>\r\n<li><span>Zapięcie:</span> Regulowane zapięcie na rzep, umożliwiające łatwe dopasowanie i stabilne trzymanie rękawic na dłoniach</li>\r\n<li><span>Wzmocnienia:</span> Dodatkowe wzmocnienia na dłoniach i kciukach, zapewniające ochronę przed kontuzjami i urazami</li>\r\n<li><span>Zastosowanie:</span> Idealne do treningów na worku bokserskim, worku treningowym, sparingów oraz walk na ringu</li>\r\n<li><span>Dodatkowe cechy:</span>\r\n<ul>\r\n<li>Wysoka jakość wykonania i staranność w szczegółach, zapewniające trwałość i wytrzymałość rękawic</li>\r\n<li>Oddychające materiały, które zapobiegają przegrzewaniu się dłoni podczas intensywnego treningu</li>\r\n<li>Stylowy design i wyraziste kolory, które dodają charakteru i pewności siebie podczas treningu lub walki</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>Nasze rękawice bokserskie to nie tylko niezbędny element wyposażenia każdego boksera, ale także wyraz osobistego stylu i determinacji. Wybierz rękawice, które pasują do Twojego charakteru i ciesz się komfortem oraz ochroną podczas każdej walki!</p>', 'rekawice-bokserskie-', '', '', '', 'Rękawice bokserskie', '', '', '', '', NULL),
(294, 1, 1, '', '<p>Nasze sportowe buty Nike w kolorze białym z wyrazistymi pomarańczowymi wstawkami to doskonały wybór dla wszystkich aktywnych osób, które cenią sobie nie tylko wygodę, ale także stylowy wygląd. Zaprojektowane z myślą o wydajności i komforcie, te buty są idealne zarówno do treningu, jak i codziennego użytku.</p>\r\n<ul>\r\n<li><span>Marka:</span> Nike</li>\r\n<li><span>Kolor:</span> Biały z pomarańczowymi wstawkami</li>\r\n<li><span>Typ:</span> Sportowe buty treningowe</li>\r\n<li><span>Materiał zewnętrzny:</span> Wytrzymała, oddychająca tkanina tekstylna, zapewniająca przewiewność i lekkość</li>\r\n<li><span>Podeszwa:</span> Elastyczna podeszwa środkowa z pianki EVA, która absorbuje wstrząsy i zapewnia amortyzację podczas każdego kroku</li>\r\n<li><span>Wyściółka:</span> Miękka wyściółka wewnętrzna, która zapewnia dodatkowy komfort i wsparcie dla stopy</li>\r\n<li><span>System wiązania:</span> Tradycyjne sznurowadła, które umożliwiają łatwe dopasowanie butów do stopy</li>\r\n<li><span>Podeszwa zewnętrzna:</span> Trwała podeszwa zewnętrzna z gumy lub specjalnej mieszanki gumy, zapewniająca przyczepność i stabilność na różnych powierzchniach</li>\r\n<li><span>Stylowy design:</span> Wyraziste pomarańczowe wstawki nadają butom unikalny i dynamiczny wygląd, który wyróżnia się na tle innych modeli</li>\r\n<li><span>Zastosowanie:</span> Doskonałe do biegania, treningów w siłowni, zajęć fitness czy również do codziennego noszenia, dodając sportowy akcent do każdej stylizacji</li>\r\n</ul>\r\n<p>Nasze sportowe buty Nike to nie tylko sprzęt do ćwiczeń, ale także wyraz Twojego aktywnego trybu życia i indywidualnego stylu. Wybierz te buty i ciesz się wygodą, wsparciem i energią, które zapewnią Ci podczas każdej aktywności fizycznej!</p>', 'sportowe-buty-nike-', '', '', '', 'Sportowe buty Nike', '', '', '', '', NULL),
(295, 1, 1, '', '<div class=\"flex flex-grow flex-col max-w-full\">\r\n<div class=\"min-h-[20px] text-message flex flex-col items-start whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 juice:w-full juice:items-end overflow-x-auto gap-2\">\r\n<div class=\"flex w-full flex-col gap-1 juice:empty:hidden juice:first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>\"Amethyst Elegance\" to wyjątkowy perfum, który emanuje elegancją i tajemniczością. Zaprezentowany w stylowym stożkowym flakonie, którego głęboki fioletowy kolor symbolizuje luksus i ekstrawagancję, ten zapach zachwyca zarówno swoją kompozycją, jak i wyglądem.</p>\r\n<ul>\r\n<li><span>Nazwa:</span> Amethyst Elegance</li>\r\n<li><span>Typ zapachu:</span> Kwiatowo-owocowy</li>\r\n<li><span>Główne nuty zapachowe:</span>\r\n<ul>\r\n<li>Nuta głowy: Soczyste jagody, czarna porzeczka, jabłko</li>\r\n<li>Nuta serca: Kwiat fiołka, piwonia, jaśmin</li>\r\n<li>Nuta bazy: Ambra, paczula, wanilia</li>\r\n</ul>\r\n</li>\r\n<li><span>Charakter zapachu:</span> \"Amethyst Elegance\" to zapach pełen elegancji i kobiecości, który otula użytkowniczkę nutami owoców i kwiatów, pozostawiając po sobie delikatne, ale trwałe wrażenie.</li>\r\n<li><span>Opakowanie:</span> Stożkowy flakon o głębokim fioletowym odcieniu, który przykuwa wzrok swoją niezwykłą formą. Elegancki i jednocześnie nowoczesny, flakon ten jest doskonałym dopełnieniem luksusowego charakteru perfumu.</li>\r\n<li><span>Zastosowanie:</span> Idealny na wieczorne wyjścia, randki oraz specjalne okazje, \"Amethyst Elegance\" dodaje niepowtarzalnego uroku i klasy każdej kobiecie, która go nosi.</li>\r\n</ul>\r\n<p>\"Amethyst Elegance\" to nie tylko zapach, ale także wyraz osobistej elegancji i wyrafinowania. Dzięki swojej unikalnej kompozycji zapachowej i eleganckiemu flakonowi, ten perfum stanowi doskonały wybór dla kobiet ceniących wysoką jakość i niepowtarzalny styl.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mt-1 flex gap-3 empty:hidden juice:-ml-3\">\r\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\r\n<div class=\"flex items-center\"><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span><span><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"><span class=\"flex h-[30px] w-[30px] items-center justify-center\"></span></button></span>\r\n<div class=\"flex\"></div>\r\n<div class=\"flex items-center pb-0.5 juice:pb-0\"></div>\r\n</div>\r\n</div>\r\n</div>', 'perfumy-amethyst-elegance', '', '', '', 'Perfumy \"Amethyst Elegance\"', '', '', '', '', NULL),
(296, 1, 1, '', '<ul>\r\n<li><span>Typ zapachu:</span> Kwiatowo-aldehydowy</li>\r\n<li><span>Główne nuty zapachowe:</span>\r\n<ul>\r\n<li>Nuta głowy: Aldehydy, neroli, bergamotka, cytryna</li>\r\n<li>Nuta serca: Jamin, róża, irys, ylang-ylang</li>\r\n<li>Nuta bazy: Wetywer, piżmo, drzewo sandałowe, wanilia</li>\r\n</ul>\r\n</li>\r\n<li><span>Charakter zapachu:</span> Chanel No. 5 to ikoniczny zapach, który od lat symbolizuje klasykę, elegancję i luksus. Jego wyjątkowa kompozycja łączy świeżość cytrusów i aldehydów z bogactwem kwiatowych akcentów, tworząc zapach pełen zmysłowości i wyrafinowania. Jest to zapach uniwersalny, który doskonale sprawdza się zarówno na co dzień, jak i na wyjątkowe okazje.</li>\r\n<li><span>Opakowanie:</span> Charakterystyczny kwadratowy flakon o minimalistycznym designie, zdobiony logo Chanel i numerem 5, który symbolizuje niepowtarzalność i ekskluzywność tego zapachu. Elegancka butelka w kolorze szkła pozwala podziwiać jego złocisty płyn, dodając mu dodatkowego prestiżu.</li>\r\n</ul>\r\n<p>Chanel No. 5 to nie tylko zapach, to symbol klasycznej elegancji i ponadczasowego stylu, który inspiruje i fascynuje kolejne pokolenia. To esencja luksusu i wyjątkowości, którą każda kobieta może nosić z dumą.</p>', 'chanel-no-5', '', '', '', 'Chanel No. 5', '', '', '', '', NULL),
(297, 1, 1, '', '<ul>\r\n<li><span>Typ zapachu:</span> Drzewno-pikantny</li>\r\n<li><span>Główne nuty zapachowe:</span>\r\n<ul>\r\n<li>Nuta głowy: Jabłko, cytrusy</li>\r\n<li>Nuta serca: Goździk, cynamon</li>\r\n<li>Nuta bazy: Drewno sandałowe, cedr</li>\r\n</ul>\r\n</li>\r\n<li><span>Charakter zapachu:</span> Boss Bottled to klasyczny, elegancki i męski zapach, który emanuje pewnością siebie i charyzmą. Zbalansowana kombinacja świeżych owoców, przypraw i drewna sprawia, że jest to idealny wybór zarówno na dzień, jak i na wieczór.</li>\r\n<li><span>Opakowanie:</span> Butelka o prostym, eleganckim designie, z logo marki Hugo Boss, podkreślająca luksusowy charakter zapachu.</li>\r\n</ul>', 'boss-bottled-', '', '', '', 'Boss Bottled', '', '', '', '', NULL),
(298, 1, 1, '', 'Typ zapachu: Drzewno-orientalny<br /><br />Główne nuty zapachowe:<br /><br />\r\n<ul>\r\n<li>Nuta głowy: Mięta, cytryna, zielone jabłko</li>\r\n<li>Nuta serca: Tonka, ambrozja, geranium</li>\r\n<li>Nuta bazy: Wanilia, cedr z Atlasu, wetiwer</li>\r\n</ul>\r\nCharakter zapachu: Versace Eros to zapach pełen mocy i zmysłowości, który przyciąga uwagę i zachwyca swoją intensywnością. Mieszanka świeżych owoców, orientalnych przypraw i drzewnych nut tworzy niezwykle uwodzicielską kompozycję, idealną dla mężczyzn pewnych siebie i przyciągających uwagę.<br /><br />Opakowanie: Butelka o klasycznym kształcie, ozdobiona charakterystycznym logo Meduzy Versace, w kolorach złotym i białym, które symbolizują bogactwo i luksus.\r\n<p>Każdy z tych perfum oferuje wyjątkową kombinację zapachowych doznań i stylu, który doskonale oddaje osobowość mężczyzny, który go nosi.</p>', 'versace-eros', '', '', '', 'Versace Eros', '', '', '', '', NULL),
(299, 1, 1, '', '<ul>\r\n<li><span>Typ zapachu:</span> Oriento-Drzewno-Kwiatowy</li>\r\n<li><span>Główne nuty zapachowe:</span>\r\n<ul>\r\n<li>Nuta głowy: Bergamotka, cytrusy, czarna porzeczka</li>\r\n<li>Nuta serca: Róża, jaśmin, paczula</li>\r\n<li>Nuta bazy: Drzewo sandałowe, wetiwer, piżmo</li>\r\n</ul>\r\n</li>\r\n<li><span>Charakter zapachu:</span> Chanel Noir to tajemniczy i intrygujący zapach, który wciąga swoją głębią i intensywnością. Inspirujące nuty kwiatowe przeplatają się z drzewnymi akcentami, tworząc kompozycję, która jest zarówno elegancka, jak i zmysłowa. Ten zapach emanuje pewnością siebie i klasy, sprawiając, że noszący go mężczyzna lub kobieta wyróżnia się spośród tłumu.</li>\r\n<li><span>Opakowanie:</span> Stożkowy flakon w kolorze głębokiej czerni, ozdobiony subtelnie połyskującymi akcentami, które podkreślają luksusowy charakter zapachu. Charakterystyczne logo Chanel dodaje elegancji i prestiżu.</li>\r\n</ul>\r\n<p>Chociaż \"Chanel Noir\" nie jest faktycznym zapachem Chanel, wyobrażony opis powyżej przedstawia potencjalną wizję takiego zapachu, który byłby zgodny z estetyką i wartościami marki Chanel.</p>', 'chanel-noir', '', '', '', 'Chanel Noir', '', '', '', '', NULL);
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`, `my_extra_field_description`) VALUES
(301, 1, 1, '', '<ul>\r\n<li><span>Typ zapachu:</span> Drzewno-wodny</li>\r\n<li><span>Główne nuty zapachowe:</span>\r\n<ul>\r\n<li>Nuta głowy: Mięta, zielona nuta</li>\r\n<li>Nuta serca: Lawenda, rozmaryn, geranium</li>\r\n<li>Nuta bazy: Ambra, piżmo, cedr</li>\r\n</ul>\r\n</li>\r\n<li><span>Charakter zapachu:</span> Davidoff Cool Water to ikoniczny zapach, który od lat kojarzony jest z świeżością, energią i wolnością. Inspiracją do jego stworzenia były morskie fale i nieokiełznana siła oceanu. Nuty świeżej mięty i zielonej nuty otwierają kompozycję, podkreślając jej świeżość i dynamikę. W sercu zapachu dominuje lawenda, która nadaje mu elegancji i wyrafinowania, podczas gdy baza z ambry, piżma i cedru dodaje mu głębi i trwałości.</li>\r\n<li><span>Opakowanie:</span> Butelka zapachu Cool Water ma charakterystyczny kształt, przypominający chłodną, morską falę. Przejrzysty flakon pozwala podziwiać klarowny, błękitny płyn, który symbolizuje czystość i świeżość zapachu.</li>\r\n</ul>\r\n<p>Davidoff Cool Water to nie tylko zapach, to styl życia, który inspiruje do odkrywania nowych przygód i eksplorowania nieznanych obszarów. To idealny wybór dla mężczyzn, którzy cenią sobie wolność, świeżość i naturalną siłę oceanu.</p>', 'davidoff-cool-water', '', '', '', 'Davidoff Cool Water', '', '', '', '', NULL),
(302, 1, 1, '', '<ul>\r\n<li><span>Typ zapachu:</span> Drzewno-orientalny</li>\r\n<li><span>Główne nuty zapachowe:</span>\r\n<ul>\r\n<li>Nuta głowy: Grejpfrut, mięta pieprzowa, cynamon</li>\r\n<li>Nuta serca: Róża, przyprawy, skóra</li>\r\n<li>Nuta bazy: Drzewo cedrowe, paczula, bursztyn</li>\r\n</ul>\r\n</li>\r\n<li><span>Charakter zapachu:</span> One Million to zapach pełen kontrastów, który łączy w sobie świeżość owoców z intensywnością orientalnych nut. Wprowadzające w życie nuty grejpfruta i mięty pieprzowej ożywiają zmysły, podczas gdy pikantny cynamon dodaje zapachowi głębi i charakteru. W sercu zapachu dominuje połączenie róży, przypraw i skóry, które nadają mu męskiego i zmysłowego wyrazu. Baza z drzewa cedrowego, paczuli i bursztynu sprawia, że zapach jest trwały i hipnotyzujący.</li>\r\n<li><span>Opakowanie:</span> Butelka zapachu One Million to prawdziwy symbol luksusu i bogactwa. Złoty flakon w kształcie lingota złota, ozdobiony logo marki Paco Rabanne, emanuje prestiżem i ekskluzywnością. To butelka, która przyciąga uwagę i podkreśla wyjątkowy charakter zapachu.</li>\r\n</ul>\r\n<p>Paco Rabanne One Million to nie tylko zapach, to manifestacja męskości, siły i sukcesu. To perfumy dla mężczyzn, którzy cenią sobie luksus, pewność siebie i niezależność. Jego wyjątkowy charakter sprawia, że jest to idealny wybór zarówno na wieczorne wyjścia, jak i na specjalne okazje, które wymagają wyjątkowego stylu i elegancji.</p>', 'paco-rabanne-one-million', '', '', '', 'Paco Rabanne One Million', '', '', '', '', NULL),
(304, 1, 1, '', '<p>Nasze brokatowe lakiery do paznokci \"Glamour Sparkle\" to idealny wybór dla każdej miłośniczki błysku i elegancji. Te wyjątkowe lakiery dodadzą blasku Twoim paznokciom, sprawiając, że będą wyglądały olśniewająco przy każdej okazji. Dostępne w pięciu zachwycających kolorach, nasze lakiery zapewnią Ci niezapomniany efekt manicure.</p>\r\n<ul>\r\n<li><span>Kolory:</span>\r\n<ul>\r\n<li><span>Żółty Brokatowy:</span> Energetyzujący zielony lakier z połyskującymi drobinkami, który przypomina blask wiosennej trawy w słońcu.</li>\r\n<li><span>Niebieski Brokatowy:</span> Głęboki niebieski lakier z błyszczącymi drobinkami, inspirowany kolorami morskiej głębiny i nocnego nieba.</li>\r\n<li><span>Czerwony Brokatowy:</span> Intensywny czerwony lakier z migoczącymi drobinkami, który nadaje paznokciom elegancki i odważny wygląd.</li>\r\n<li><span>Różowy Brokatowy:</span> Uroczy różowy lakier z iskrzącymi drobinkami, idealny dla romantyczek i miłośniczek delikatnych, kobiecych kolorów.</li>\r\n<li><span>Fioletowy Brokatowy:</span> Tajemniczy fioletowy lakier z połyskującymi drobinkami, który dodaje paznokciom głębi i wyrafinowania.</li>\r\n</ul>\r\n</li>\r\n<li><span>Pojemność:</span> 10 ml</li>\r\n<li><span>Wykończenie:</span> Brokatowe, z intensywnym blaskiem</li>\r\n<li><span>Formuła:</span> Szybkoschnąca, długotrwała, łatwa w aplikacji</li>\r\n<li><span>Aplikacja:</span> Precyzyjny pędzelek, który umożliwia równomierne rozprowadzenie lakieru na paznokciach</li>\r\n<li><span>Dodatki:</span> Każdy lakier ozdobiony jest małą czarną kokardką przy szyjce, dodając elegancji i uroku</li>\r\n</ul>\r\n<p><span>Zastosowanie:</span> Idealne na specjalne okazje, imprezy, a także na co dzień, gdy chcesz dodać swojemu wyglądowi odrobinę blasku i wyjątkowości. Nasze brokatowe lakiery do paznokci \"Glamour Sparkle\" to doskonały wybór dla każdej kobiety, która pragnie poczuć się wyjątkowo i stylowo.</p>', 'brokatowe-lakiery-do-paznokci-glamour-sparkle', '', '', '', 'Brokatowe Lakiery do Paznokci \"Glamour Sparkle\"', '', '', '', '', NULL);
